INSERT INTO `table_info` (`id`, `id_cat`, `type`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `title`, `keywords`, `description`, `photo`, `thumb`, `background`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `ten_ja`, `noidung_ja`, `mota_ja`) VALUES
(4, '', 'lienhe', 'HÃY GỌI CHO CHÚNG TÔI', 'hay-goi-cho-chung-toi', '', '<p style=\"text-align: center;\">Phan Nguyễn là nơi được lựa chọn để chuyển tải yêu thương và lưu giữ lại những khoảnh khắc ngọt ngào, thăng hoa của tình yêu...</p>\r\n', '', '', '<p>lien he</p>\r\n', '0', '0', '0', '', '', '', '', '', '', 0, 0, 1444374572, 1453359504, '', '', ''),
(5, '', 'giaohang', '', '', '', '<dl class=\"accord\">\r\n	<dd class=\"faq-content\" style=\"display: block;\">\r\n	<p>Trước khi gửi lại một sản phẩm cho Lazada.vn để đổi trả hàng, quý khách vui lòng tham khảo <a href=\"http://www.lazada.vn/helpcenter/returns-refunds/#answer-faq-returnpolicy-ans\" target=\"_blank\"><strong>Chính sách đổi trả hàng</strong></a> của chúng tôi nhằm đảm bảo sản phẩm này có đủ điều kiện để hoàn trả.</p>\r\n\r\n	<p>Nếu sản phẩm của quý khách đáp ứng tất cả các yêu cầu về đổi trả hàng, việc đổi trả sẽ được xử lý nhanh hơn nếu quý khách điền vào <a href=\"http://www.lazada.vn/customer/order/index\" target=\"_blank\">Phiếu đăng ký đổi trả hàng trực tuyến</a>. Hoặc quý khách cũng có thể in và sử dụng <a href=\"http://campaign.lazada.vn/static/ops/Return_Slip-A6.pdf\" target=\"_blank\">Phiếu đăng ký đổi trả hàng thông thường</a>.</p>\r\n	<img alt=\"\" src=\"http://static.lazada.vn/cms/faq-screenshot/return-step-vn.png\" />\r\n	<p>Sau khi điền vào phiếu đăng ký đổi trả, quý khách chỉ cần làm theo 3 bước đơn giản sau:</p>\r\n	<img alt=\"\" src=\"http://static.lazada.vn/cms/faq-screenshot/return-step-vn-2.png\" />\r\n	<p><br />\r\n	<strong>Lưu ý</strong>: Để đảm bảo sản phẩm được hoàn trả về bộ phận kiểm tra chất lượng hàng đổi trả của Lazada.vn mà không phải mất thêm bất cứ chi phí vận chuyển nào, quý khách vui lòng gửi sản phẩm về Lazada.vn bằng một trong hai mã vận chuyển miễn phí sau theo địa chỉ tương ứng được ghi trên Phiếu đăng kí đổi trả hàng:</p>\r\n\r\n	<ul>\r\n		<li><strong>70C-0816-005SG</strong> – Kho Lazada.vn HCM (Các bưu gửi từ TP.Đà Nẵng trở vào phía Nam): Kho xưởng 1-2, Cụm 1, Đường M14, KCN Tân Bình mở rộng, phường Bình Hưng Hòa, Q. Bình Tân, TP. Hồ Chí Minh</li>\r\n		<li><strong>10EMSC 1217 - 001TT</strong> – Lazada.vn HN (Các bưu gửi từ tỉnh Thừa Thiên Huế trở ra phía Bắc): Kho Lazada.vn, lô 2 đường Độc Lập, KCN Hà Bình Phương, thị trấn Thường Tín, TP. Hà Nội</li>\r\n	</ul>\r\n\r\n	<p>Quý khách vui lòng đóng gói phiếu đăng ký đổi trả và toàn bộ sản phẩm, phụ kiện, quà tặng (nếu có) và các giấy tờ bao gồm hóa đơn, hướng dẫn sử dụng, phiếu bảo hành... vào bên trong thùng hàng để tránh thất lạc. Quý khách có trách nhiệm về tính toàn vẹn của hàng hóa khi gửi về Lazada. Mọi mất mát, hư hỏng Lazada sẽ không chịu trách nhiệm.</p>\r\n\r\n	<p>Quý khách nên chụp ảnh sản phẩm trước khi đổi trả hàng, việc lưu giữ hình ảnh trong các trường hợp này cũng sẽ góp phần giải quyết tốt hơn các vấn đề phát sinh trong quá trình đổi trả.</p>\r\n\r\n	<p>Ngoài ra, quý khách vui lòng thông báo cho Lazada.vn trong vòng 48 giờ từ lúc nhận hàng nếu sản phẩm nhận được không nguyên vẹn, móp, trầy xước, bể vỡ, hàng cũ/ đã qua sử dụng hoặc thiếu các linh kiện cần thiết.</p>\r\n\r\n	<p>Để được hướng dẫn chi tiết các thao tác thực hiện, quý khách vui lòng tham khảo tại <a href=\"http://www.lazada.vn/chinh-sach-doi-tra-hang/\" target=\"_blank\">đây</a>. Ngoài ra, quý khách có thể liên hệ bộ phận Chăm sóc khách hàng tại <a href=\"http://www.lazada.vn/contact/\" target=\"_blank\">đây</a>. Lazada.vn hân hạnh phục vụ quý khách.</p>\r\n	</dd>\r\n	<dt id=\"faq-trackreturn-ans\"><a><span>Làm thế nào để kiểm tra tình trạng đổi trả hàng?</span></a></dt>\r\n	<dd class=\"faq-content\" style=\"display: block;\">\r\n	<p>Ngay khi gửi sản phẩm về cho Lazada.vn qua bưu cục VNPost, quý khách vui lòng lưu lại số hiệu bưu gửi (mã vận đơn) để có thể tra cứu hành trình kiện hàng gửi trả tại <a href=\"http://www.vnpost.vn\" target=\"_blank\">www.vnpost.vn</a></p>\r\n\r\n	<p>Sau khi sản phẩm của quí khách được gửi về đến kho, chúng tôi sẽ tiến hành kiểm tra đánh giá chất lượng sản phẩm và thời gian để hoàn tất qui trình này cần 3-5 ngày làm việc. Ngay sau khi có kết quả kiểm tra, chúng tôi sẽ gửi thông báo đến quý khách qua điện thoại, tin nhắn hoặc email.</p>\r\n\r\n	<p>Sau khi nhận được thông báo, quý khách có thể sử dụng công cụ tra cứu đơn hàng trực tuyến của Lazada.vn tại <a href=\"http://www.lazada.vn/kiem-tra-don-hang\" target=\"_blank\">www.lazada.vn/kiem-tra-don-hang</a> để kiểm tra tình trạng đổi hàng hoặc hoàn tiền (quý khách cần đăng nhập vào tài khoản, và chọn đơn hàng quý khách đã kích hoạt chức năng đổi trả).</p>\r\n	</dd>\r\n	<dt id=\"faq-qualityevaluation-ans\"><a><span>Sau bao lâu tôi có thể nhận được kết quả đổi trả hàng của tôi?</span></a></dt>\r\n	<dd class=\"faq-content\" style=\"display: block;\">\r\n	<p>Quy trình đánh giá chất lượng sản phẩm này có thể cần khoảng 5 ngày làm việc tính từ thời điểm Lazada.vn nhận được sản phẩm gửi trả tại kho. Sau đó quý khách sẽ nhận được email thông báo kết quả kiểm tra đánh giá sản phẩm.</p>\r\n\r\n	<p>Việc gửi sản phẩm thay thế hoặc hoàn tiền chỉ được bắt đầu sau khi Lazada.vn đã nhận đầy đủ thông tin xác nhận từ khách hàng.</p>\r\n	</dd>\r\n	<dt id=\"faq-returnshipmentcost-ans\"><a><span>Lazada.vn có thanh toán tiền phí vận chuyển cho sản phẩm đổi trả?</span></a></dt>\r\n	<dd class=\"faq-content\" style=\"display: block;\">\r\n	<p>Quý khách sẽ được miễn phí vận chuyển khi gửi lại sản phẩm đổi trả cho Lazada.vn qua bưu điện Vnpost bằng một trong hai mã vận chuyển miễn phí <strong>70C-0816-005SG</strong> – Kho Lazada.vn HCM hoặc <strong>10EMSC 1217 - 001TT</strong> – kho Lazada.vn Hà Nội theo địa chỉ được ghi trên Phiếu đăng kí đổi trả hàng. Lazada.vn hiện chưa hỗ trợ chi phí vận chuyển nếu quý khách gửi hàng thông qua các đơn vị vận chuyển khác.</p>\r\n\r\n	<p><strong>Lưu ý</strong>: Các mã bưu gửi chỉ áp dụng đối với bưu cục VNPost (VNPT cũ). Nếu quý khách gặp bất cứ trở ngại nào trong việc gửi hàng qua bưu cục VNPost, vui lòng liên hệ số điện thoại Hỗ trợ của Bưu cục tổng (08) 3827 0999</p>\r\n	</dd>\r\n	<dt id=\"faq-qualityevaluation-ans\"><a><span>Sau khi tôi thực hiện yêu cầu đổi trả hàng trực tuyến, sẽ có người đến tận nhà nhận lại hàng của tôi phải không?</span></a></dt>\r\n	<dd class=\"faq-content\" style=\"display: block;\">\r\n	<p>Việc quý khách thực hiện yêu cầu đổi trả hàng trực tuyến trên website chỉ là bước Lazada.vn ghi nhận lại thông tin về sản phẩm quý khách muốn đổi trả và hướng xử lý mong muốn. Quý khách vẫn cần phải đóng gói và gửi sản phẩm về Lazada.vn để được hỗ trợ xử lý các bước tiếp theo. Chi tiết về thao tác đăng ký đổi trả hàng trực tuyến, quý khách tham khảo tại <a href=\"http://www.lazada.vn/huong-dan-tra-hang-truc-tuyen/\" target=\"_blank\">www.lazada.vn/huong-dan-tra-hang-truc-tuyen/</a></p>\r\n	</dd>\r\n	<dt id=\"faq-qualityevaluation-ans\"><a><span>Làm sao để tôi biết được tôi đã thực hiện thành công yêu cầu đổi trả hàng trực tuyến?</span></a></dt>\r\n	<dd class=\"faq-content\" style=\"display: block;\">\r\n	<p>Sau khi quý khách hoàn tất các bước điền thông tin tại biểu mẫu <strong>“Yêu cầu đổi trả hàng trực tuyến”</strong>, màn hình giao diện trên website sẽ hiển thị thông báo về yêu cầu đổi trả của quý khách đã được cập nhật thành công.</p>\r\n	</dd>\r\n	<dt id=\"faq-qualityevaluation-ans\"><a><span>Sau bao lâu kể từ lúc gửi yêu cầu đổi trả hàng trực tuyến tôi sẽ nhận được phản hồi?</span></a></dt>\r\n	<dd class=\"faq-content\" style=\"display: block;\">\r\n	<p>Việc gửi yêu cầu đổi trả hàng trực tuyến là bước đầu tiên của quy trình đổi trả. Việc gửi sản phẩm thay thế hoặc hoàn tiền chỉ được bắt đầu sau khi chúng tôi đã nhận sản phẩm quý khách gửi về tại kho và hoàn tất việc kiểm tra đánh giá tình trạng sản phẩm. Quy trình đánh giá chất lượng sản phẩm này có thể cần khoảng 5 ngày làm việc tính từ thời điểm Lazada.vn nhận được sản phẩm gửi trả tại kho.</p>\r\n	</dd>\r\n	<dt id=\"faq-qualityevaluation-ans\"><a><span>Tôi có thể vừa thực hiện yêu cầu đổi trả hàng trực tuyến vừa mang sản phẩm đến đổi trả tại các Văn phòng của Lazada.vn không?</span></a></dt>\r\n	<dd class=\"faq-content\" style=\"display: block;\">\r\n	<p>Quý khách hoàn toàn có thể mang sản phẩm đến các Văn văn phòng Lazada.vn ở TP.HCM, Hà Nội và một số tỉnh/ thành phố sau để đổi trả, sau khi thực hiện yêu cầuđăng ký đổi trả hàng trực tuyến trên website.</p>\r\n\r\n	<p><strong>Lưu ý</strong>: Thời gian phục vụ: Từ 9:30 - 17:30 các ngày từ thứ 2 đến thứ 7 (không làm việc vào chủ nhật và các ngày lễ Tết)</p>\r\n\r\n	<p><b>Đối với khách hàng tại TP. Hồ Chí Minh:</b> Văn phòng: 236/12/11 Điện Biên Phủ, phường 17, quận Bình Thạnh, TPHCM</p>\r\n\r\n	<p><b>Văn phòng tại Thủ Đức:</b> 238/7 Hoàng Diệu 2, phường Linh Chiểu, quận Thủ Đức, TPHCM.</p>\r\n\r\n	<p><b>Văn phòng tại Hà Nội:</b>Kho Lazada.vn, lô 2 đường Độc Lập, KCN Hà Bình Phương, thị trấn Thường Tín, Tp. Hà Nội</p>\r\n\r\n	<p><b>Văn phòng tại Hải Phòng:</b> Số 119 Lô 26D Lê Hồng Phòng, Quận Ngô Quyền, thành phố Hải Phòng.</p>\r\n\r\n	<p><b>Văn phòng tại Đà Nẵng:</b> 24 Kỳ Đồng, phường Xuân Hà, quận Thanh Khê, Đà Nẵng.</p>\r\n\r\n	<p><b>Văn phòng tại Nha Trang:</b> 38B Trần Nhật Duật, phường Phước Hòa, thành phố Nha Trang.</p>\r\n\r\n	<p><b>Văn phòng tại Biên Hòa:</b> 49 Hưng Đạo Vương, khu phố 1, phường Quyết Thắng, thành phố Biên Hòa, tỉnh Đồng Nai</p>\r\n\r\n	<p><b>Văn phòng tại Cần Thơ:</b> 79 Nguyễn Đệ, phường An Hòa, quận Ninh Kiều, thành phố Cần Thơ.</p>\r\n\r\n	<p><b>Văn phòng tại Buôn Mê Thuột:</b> 88 Trần Hưng Đạọ, Phường Tự An, Thành phố Buôn Ma Thuột, Tỉnh Daklak.</p>\r\n\r\n	<p><b>Văn phòng tại Bình Dương:</b> 29 đường D35 khu dân cư Việt Sing, An Phú, Thuận An , Bình Dương.</p>\r\n\r\n	<p><b>Văn phòng tại Huế:</b> 118 Phan Chu Trinh, P. Phước Vĩnh, thành phố Huế, tỉnh Thừa Thiên Huế.</p>\r\n\r\n	<p><b>Văn phòng tại Vũng Tàu:</b> 140 Phạm Hồng Thái, phường 7, thành phố Vũng Tàu, tỉnh Bà Rịa-Vũng Tàu.</p>\r\n	</dd>\r\n</dl>\r\n', '', '', '', '0', '0', '0', '', '', '', '', '', '', 1, 0, 1445594723, 0, '', '', '');
INSERT INTO `table_info` (`id`, `id_cat`, `type`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `title`, `keywords`, `description`, `photo`, `thumb`, `background`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `ten_ja`, `noidung_ja`, `mota_ja`) VALUES
(2, '', 'gioithieu', 'Về chúng tôi', 've-chung-toi', '<p><br />\r\nUống đủ nước mỗi ngày là điều cực kỳ quan trọng nếu như bạn muốn có một cơ thể khỏe mạnh. Nước khoáng nói chung và nước khoáng Lavie nói riêng không chỉ đơn giản giúp bạn thỏa mãn cơn khát, nó còn là thứ nguồn sống nuôi dưỡng cơ thể với các ‘nhiệm vụ’ đặc biệt cấu: Nuôi dưỡng tế bào, đào thải các chất cặn bã, chuyển hóa và tham gia quá trình trao đổi chất, ổn định nhiệt độ cơ thể,… Sử dụng nguồn nước khoáng sạch không chỉ giúp bạn có một cơ thể tràn đầy sức sống mà còn giúp tránh được rất nhiều các bệnh thường gặp.</p>\r\n\r\n<p>Nước khoáng nói chung và nước khoáng Lavie nói riêng không chỉ đơn giản giúp bạn thỏa mãn cơn khát, nó còn là thứ nguồn sống nuôi dưỡng cơ thể với các ‘nhiệm vụ’ đặc biệt cấu: Nuôi dưỡng tế bào, đào thải các chất cặn bã, chuyển hóa và tham gia quá trình trao đổi chất, ổn định nhiệt độ cơ thể,… Sử dụng nguồn nước khoáng sạch không chỉ giúp bạn có một cơ thể tràn đầy sức sống mà còn giúp tránh được rất nhiều các bệnh thường gặp.<br />\r\nVới thói quen sử dụng nhiều các loại thực phẩm gây gại cho cơ thể như các loại nước có ga, chất kích thích, ăn nhiều dầu mỡ, chế độ sinh hoạt thất thường khiến cho cơ thể thiếu đi rất nhiều chất quan trọng như Megie, Canxi,... Vì vậy mà một nguồn nước uống sạch hàng ngày có lẽ chưa đủ. Bạn cần một dòng nước thiên nhiên tốt nhất cho sức khỏe với các khoáng chất tự nhiên vừa đủ, thúc đẩy quá trình trao đổi chất, thanh lọc cơ thể, khiến cho cơ thể khỏe mạnh hơn.</p>\r\n', '<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Hầu hết mỗi công ty đều có bài giới thiệu về doanh nghiệp mình, nhưng để có  được một bài giới thiệu đầy đủ, hiệu quả để chinh phục được khách hàng cũng như đối tác thì không phải doanh nghiệp nào cũng làm được.</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Đặc biệt khi mà nền kinh tế vẫn còn khủng hoảng với rất nhiều khó khăn càng đẩy sự cạnh tranh lên cao, thì một bài giới thiệu tốt sẽ là một yếu tố không nhỏ giúp Doanh nghiệp bạn chứng tỏ được khả năng cũng như thế mạnh của mình. Ngoài ra với một bài giới thiệu được trình bày một cách chuyên nghiệp, sẽ đem lại sự thiện cảm ban đầu cho người xem, đó là một lợi thế mà các doanh nghiệp nên nắm bắt.</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Nếu như về phần giới thiệu sản phẩm thường có rất nhiều bài khác nhau, nhưng với bài giới thiệu doanh nghiệp lại chỉ có một. Chính vì vậy cần một sự đầu tư kỹ lưỡng cả về nội dung lẫn hình thức, vì nó phần nào thể hiện bộ mặt của toàn doanh nghiệp.</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; font-weight: 700; background: transparent;\">Vậy làm sao để có bài giới thiệu doanh nghiệp hoàn thiện và thu hút người xem tối ưu nhất ?</span></p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Trước tiên, bài giới thiệu cần có phần tóm lược đầy đủ mọi thông tin về Doanh nghiệp gồm : lịch sử hình thành và phát triển. Tên đầy đủ của doanh nghiệp.<br style=\"box-sizing: border-box;\" />\r\nSau đó giới thiệu tổng quát về ngành nghề hoạt động, mạng lưới hoạt động. Và điều cuối cùng là những mục tiêu hướng đến cùng những thành quả đã đạt được….</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Bên cạnh bố cục thông thường thì bài giới thiệu cần được viết một cách ngắn gọn và súc tích nhất nhằm đưa đến cho người đọc nhanh chóng nắm rỏ về công ty, doanh nghiệp. Do đó việc lựa chọn từ ngữ cũng hết sức quan trọng. Các từ ngữ phải diễn đạt tốt và logic cũng như truyền tải được những mong muốn của ban điều hành doanh nghiệp đưa ra.</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Song song với những bài giơi thiệu được đăng trên những trang web chính của doanh nghiệp, thì các bài viết giới thiệu còn hết sức cần thiết và hữu hiệu hơn khi được đăng lên các website uy tín có sức tuyên truyền và quảng bá rộng. Điều này giúp hình ảnh thương hiệu công ty bạn đến gần với các đối tác, khách hàng.</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Cũng chính vì được nhiều người biết đến, do đó những bài viết như thế cần nhiều sự chăm chút hơn. Ngoài mục đích giới thiệu đến mọi người thì bài viết này cần hướng người đọc đến hành vi mua hàng hoặc ít nhất là ghé thăm website chính.</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Đó chính là vấn đề cốt lõi mà một bài viết giới thiệu cần làm được, và để làm được điều đó thì người viết phải là một người giỏi về khả năng diễn đạt, chuyên sâu về lĩnh vực viết lời giới thiệu, quảng cáo</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">(CopyWriter) cũng như sự tìm hiểu sâu sắc về doanh nghiệp ấy. Có như vậy thì bài viết giới thiệu mới phát huy hết sức mạnh và đem lại nguồn khách hàng tiềm năng cho Doanh nghiệp.</p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; font-weight: 700; background: transparent;\">Doanh nghiệp bạn đã có những bài giới thiệu như thế chưa ?</span></p>\r\n\r\n<p background-attachment:=\"\" background-clip:=\"\" background-image:=\"\" background-origin:=\"\" background-position:=\"\" background-repeat:=\"\" background-size:=\"\" font-size:=\"\" helvetica=\"\" line-height:=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; text-align: justify; color: rgb(125, 97, 31); font-family: \">Đừng bỏ qua một cơ hội nào vì khách hàng luôn tin tưởng, lựa chọn những doanh nghiệp có sự đầu tư kỹ lưỡng, chuyên nghiệp về hình ảnh thương hiệu cũng như có sự quảng bá rộng rãi. Ngoài ra, quảng bá trên website chính là sự quảng bá nhanh chóng và mang lại hiệu quả lâu dài.</p>\r\n', 'Giới thiệu', '<div class=\"show_content_pc\">LỜI MỞ ĐẦU<br />\r\nSự phát triển mạnh mẽ của Internet, công nghệ thông tin và mạng di động với<br />\r\ncác thiết bị thông minh đã tạo cơ hội và xu hướng mới cho kinh doanh ảo, kinh<br />\r\ndoanh trực tuyến, thúc đẩy thương mại điện tử phát triển.<br />\r\nTrên nền tảng công nghệ Internet, thương mại điện tử ở Việt Nam đã hình<br />\r\nthành và phát triển nhanh chóng, đóng vai trò quan trọng trong phát triển sản xuất<br />\r\nkinh doanh của các doanh nghiệp. Ngày càng xuất hiện nhiều mô hình kinh doanh<br />\r\ntrực tuyến, công nghệ tác động tới thương mại điện tử Việt Nam trong những năm<br />\r\ntới.<br />\r\nHiện nay, xuất hiện nhiều các website cung cấp dịch vụ kinh doanh theo nhóm,<br />\r\nnơi nhiều doanh nghiệp có thể thông qua website tiến hành hoạt động truyền<br />\r\nthông, tiếp thị, trực tiếp bán hàng hóa, dịch vụ cho khách hàng như muachung.vn ,<br />\r\ncungmua.com, hotdeal…. Để hiểu rõ hơn về vấn đề này chúng ta sẽ cùng đi nghiên<br />\r\ncứu về “Mô hình kinh doanh của cungmua.com”<br />\r\nBài thảo luận gồm 3 phần:<br />\r\nChương 1: Cơ sở lý thuyết<br />\r\nChương 2:Giới thiệu về cungmua.com<br />\r\nChương 3: Mô hình kinh doanh của cungmua.com<br />\r\nChương 4: Một số giải pháp\r\n<div style=\"text-align: center;margin-top: 10px\"> </div>\r\nCHƯƠNG I: CƠ SỞ LÝ THUYẾT<br />\r\n1.Khái niệm thương mại điện tử<br />\r\nThương mại điện tử là việc tiến hành các giao dịch thương mại qua mạng internet,<br />\r\nmạng truyền thông và các phương tiện điện tử khác.<br />\r\n1.Khái niệm mô hình kinh doanh<br />\r\nMô hình kinh doanh mô tả các cơ sở nền tảng về vấn đề một tổ chức tạo ra,cung<br />\r\ncấp và đạt được các giá trị kinh tế-xã hội hoặc hình thức giá trị khác như thế<br />\r\nnào.Bản chất của một mô hình kinh doanh là nó xác định được cách thức mà các<br />\r\ndoanh nghiệp kinh doanh mang lại giá trị cho khách hàng,thu lợi nhuận từ cung<br />\r\nứng giá trị cho khách hàng.Mô hình kinh doanh cũng phản ánh giả định của doanh<br />\r\nnghiệp về những gì khách hàng muốn,làm thế nào họ muốn và làm thế nào một<br />\r\ndoanh nghiệp có thể tổ chức và đáp ứng tốt nhất những nhu cầu đó.<br />\r\n2.Các nhân tố cơ bản của mô hình kinh doanh<br />\r\n2.1.Mục tiêu giá trị<br />\r\nLà cách thức để sản phẩm hay dịch vụ của một doanh nghiệp đáp ứng được nhu<br />\r\ncầu của một khách hàng<br />\r\nTìm hiểu mục tiêu giá trị của một doanh nghiệp chính là trả lời cho câu hỏi “ Tại<br />\r\nsao khách hàng nên mua hàng của doanh nghiệp?”<br />\r\n2.2.Mô hình doanh thu<br />\r\nLà cách thức để doanh nghiệp có doanh thu, tạo ra lợi nhuận trên vốn đầu tư nhiều<br />\r\nhơn các hình thức đầu tư khác.<br />\r\nCó 5 loại mô hình doanh thu:<br />\r\n-<br />\r\n<br />\r\nMô hình doanh thu quảng cáo<br />\r\n<br />\r\n-<br />\r\n<br />\r\nMô hình doanh thu liên kết<br />\r\n<br />\r\n-<br />\r\n<br />\r\nMô hình doanh thu đăng ký<br />\r\n<br />\r\n-<br />\r\n<br />\r\nMô hình doanh thu phí giao dịch<br />\r\n<br />\r\n-\r\n<div style=\"text-align: center;margin-top: 10px\"> </div>\r\nMô hình doanh thu bán hàng<br />\r\n<br />\r\n2.3.Cơ hội thị trường<br />\r\n<br />\r\n<br />\r\nLà sự xuất hiện các yếu tố hay điều kiện thuận lợi một cách đồng thời tại một thời<br />\r\nđiểm nhất định, sao cho việc tận dụng các yếu tố đó giúp cho doanh nghiệp có<br />\r\nđược sự trưởng thành nhanh chóng và mạnh mẽ, chiếm lĩnh phần lớn thị phần, tạo<br />\r\nra thu nhập cao và phát triển bền vững.<br />\r\n2.4.Chiến lược thị trường<br />\r\nDoanh nghiệp xây dựng marketing dài hạn dựa trên tình hình kinh doanh hiên tại<br />\r\nvà những dự báo về sự phát triển kinh doanh của doanh nghiệp, những dự báo về<br />\r\nsự thay đổi thị trường kinh doanh trong thời gian dài.<br />\r\n2.5.Môi trường cạnh tranh<br />\r\nLà khả năng tương tác giữa các đối thủ cạnh tranh trong cùng một đoạn thị trường.<br />\r\n2.6.Lợi thế cạnh tranh<br />\r\nLà những gì doanh nghiệp có và điểm mạnh của doanh nghiệp<br />\r\n2.7.Sự phát triển của tổ chức<br />\r\nMỗi một doanh nghiệp cần có một hệ thống tổ chức đảm bảo thực thi có hiệu quả<br />\r\ncác kế hoạch và chiến lược kinh doanh<br />\r\n2.8.Đội ngũ quản trị<br />\r\nLà nhân tố quan trọng, một doanh nghiệp có đội ngũ quản trị giỏi chính là lợi thế<br />\r\ncạnh tranh chủ yếu của doanh nghiệp đó.<br />\r\n3.Các mô hình kinh doanh chủ yếu trong thương mại điện tử<br />\r\na.Các mô hình kinh doanh chủ yếu trong TMĐT giữa doanh nghiệp và người tiêu<br />\r\ndùng (B2C e-commerce)<br />\r\nTMĐT B2C là loại hình giao dịch trong đó khách hàng của các doanh nghiệp kinh<br />\r\ndoanh trực tuyến là những người tiêu dùng cuối cùng.<br />\r\nCác mô hình kinh doanh trong thương mại điện tử B2C bao gồm:<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nCổng thông tin<br />\r\nNhà bán lẻ điện tử<br />\r\nNhà cung cấp nội dung<br />\r\nTrung gian giao dịch<br />\r\nNhà tạo thị trường<br />\r\nNhà cung cấp dịch vụ<br />\r\nNhà cung cấp cộng đồng<br />\r\n<br />\r\n<br />\r\nb. Các mô hình kinh doanh chủ yếu trong TMĐT giữa các doanh nghiệp (B2B)<br />\r\nTMĐT B2B là loại hình quan trọng nhất,chiếm tỉ trọng lớn nhất trên internet<br />\r\nCác mô hình kinh doanh trong TMĐT B2B:<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nThị trường-sàn giao dịch<br />\r\nNhà phân phối điện tử<br />\r\nNhà cung cấp dịch vụ B2B<br />\r\nMô giới giao dịch B2B<br />\r\nTrung tâm thông tin<br />\r\n<br />\r\n4.Các mô hình kinh doanh đặc thù của TMĐT<br />\r\n-<br />\r\n<br />\r\n-<br />\r\n<br />\r\n-<br />\r\n<br />\r\nMô hình kinh doanh ngang hàng (P2P): hoạt động với mục tiêu liên kết<br />\r\nnhững người sử dụng,cho phép họ chia sẻ các tệp tin và các tài nguyên khác<br />\r\ntrên máy tính mà không cần truy cập vào một máy chủ chung<br />\r\nMô hình kinh doanh TMĐT giữa các người tiêu dùng (C2C): Mô hình kinh<br />\r\ndoanh TMĐT giữa các người tiêu dùng là cách mà người tiêu dùng có thể sử<br />\r\ndụng để bán các hàng hóa của mình cho người tiêu dùng khác với sự giúp<br />\r\nđỡ của một doanh nghiệp kinh doanh trực tuyến<br />\r\nMô hình thương mại di động: cho phép mọi đối tượng thực hiện các giao<br />\r\ndịch mua bán tại mọi thời điểm,đặc biệt là ở mọi nơi và thực hiện các thiết<br />\r\nbị cơ sở công nghệ mới, không dây.<br />\r\n<br />\r\nCHƯƠNG II: GIỚI THIỆU VỀ CUNGMUA.COM<br />\r\n<br />\r\n<br />\r\n- Cungmua.com là một kênh mua hàng trực tuyến, trực thuộc công ty cổ phần<br />\r\nCùng mua,là một sản phẩm trực thuộc Ocean Solution – doanh nghiệp đi đầu<br />\r\ntrong lĩnh vực thương mại điện tử Việt Nam.<br />\r\n- Được thành lập vào cuối năm 2013, cho tới nay \"cungmua.com\" đã phục vụ<br />\r\ntrên 01 triệu khách hàng trên toàn quốc.<br />\r\n- Triết Lý Của Cùng Mua: ” phục vụ khách hàng như chúng tôi mong muốn được<br />\r\nphục vụ”<br />\r\n- Mô hình kinh doanh B2C<br />\r\n- Tên truy cập: http://www.cungmua.com/<br />\r\n“cungmua.com” chỉ hợp tác với những đối tác có uy tín và cam kết phục vụ<br />\r\nkhách hàng tốt nhất. Với giao diện đơn giản một menu đủ với các mặt hàng, bên<br />\r\ncạnh là các sản phẩm khuyến mãi, phía dưới là các sản phẩm đại diện cho mỗi<br />\r\nmặt hàng và cuối cùng là các thông tin lien quan đến ‘cungmua.com”<br />\r\n\"cungmua.com\" là website hàng đầu về cung cấp các phiếu giảm giá về các sản<br />\r\nphẩm thời trang và mặt hàng gia dụng. Hệ thống website mua sắm của của<br />\r\n“cungmua.com” được hình thành khoảng một năm gần đây, tuy nhiên đã thu<br />\r\nhút được nhiều khách hàng tham gia mua sắm trực tuyến và cùng với sự ủng hộ<br />\r\ncủa quý khách hàng \"cungmua.com\" là website hàng đầu về cung cấp các phiếu<br />\r\ngiảm giá về các sản phẩm thời trang và mặt hàng gia dụng.<br />\r\n\"cungmua.com hiện đang cung cấp cho khách hàng trải nghiệm mua sắm những<br />\r\nđợt giảm giá và cam kết về uy tín chất lượng dịch vụ và đội ngũ nhân viên<br />\r\nchuyên nghiệp tận tình đã giúp \"cungmua.com\" bán thành công gần 5 triệu đơn<br />\r\nhàng cho hàng ngàn đối tác.<br />\r\n\"cungmua.com\" luôn nỗ lực để trở thành cầu nối nhanh và hiệu quả nhất giúp<br />\r\ndoanh nghiệp tiếp cận người tiêu dùng với phương châm “ Uy tín, trung thực và<br />\r\nchất lượng ”<br />\r\n<br />\r\n<br />\r\n<br />\r\nCHƯƠNG III: MÔ HÌNH KINH DOANH CỦA<br />\r\nCUNGMUA.COM<br />\r\nCungmua.com là trung gian giao dịch trong TMĐT B2C. Đối tượng mà cùng mua<br />\r\nhướng tới chính là những khách hàng tại Việt Nam.<br />\r\n1.Mục tiêu giá trị của cungmua.com .<br />\r\nĐến với cùng mua khách hàng sẽ có cơ hội nhận được rất nhiều những lợi ích.<br />\r\ncungmua.com cung cấp cho khách hàng những sản phẩm ở mọi nhóm ngành<br />\r\nhàng khác nhau: Thời trang, nhà hàng- ẩm thực, du lịch- khách sạn, sức khỏelàm đẹp, gia dụng- nội thất , điện tử- công nghệ….<br />\r\nỞ website này, khách hàng có thể mua mọi hàng hóa mình cần với thao tác đơn<br />\r\ngiản chỉ bằng một cái đúp chuột.<br />\r\nKhông những vậy , khách hàng mua sản phẩm tại cungmua.com với cách<br />\r\nthức mua đơn giản, giá cả phải chăng, sản phẩm chất lượng và thanh toán<br />\r\nnhanh chóng.<br />\r\n•<br />\r\nCùng Mua cam kết bán với giá tốt nhất. Cùng Mua hoạt động trên cơ sở<br />\r\nmua hàng theo số đông, trực tiếp từ nhà cung cấp mà không phải thông qua<br />\r\nnhiều cấp trung gian. Hơn nữa, Cùng Mua còn là kênh truyền thông và quảng<br />\r\ncáo cho sản phẩm, dịch vụ của nhà cung cấp. Chính vì vậy, Cùng Mua có khả<br />\r\nnăng lấy được giá tốt nhất để phục vụ khách hàng.<br />\r\n•<br />\r\n<br />\r\nHàng hóa, dịch vụ đảm bảo chất lượng.<br />\r\n<br />\r\nCùng Mua hợp tác với những đối tác có uy tín và cam kết phục vụ khách hàng<br />\r\ntốt nhất. Tất cả sản phẩm dịch vụ khuyến mãi trên Cùng Mua đều được đội ngũ<br />\r\nQA (Quality Assurance – Kiểm tra chất lượng) xem xét, nghiên cứu để đảm bảo<br />\r\nchất lượng.<br />\r\nQuy trình dành cho Đối tác:<br />\r\nBan quản lý Website TMĐTCùng Mua tổ chức thực hiện và giới thiệu các chương<br />\r\ntrình khuyến mại của Đối tác (“Deal”) có nhu cầu khuyến mại các sản phẩm,<br />\r\nhàng hóa, dịch vụ do Đối tác đó đang trực tiếp kinh doanh trên cơ sở ủy quyền<br />\r\nthực hiện chương trình khuyến mại của Đối tác với giá hấp dẫn, các phương<br />\r\nthức thanh toán linh hoạt để Thành viên có thể tham khảo, lựa chọn mua và sử<br />\r\ndụng các sản phẩm, dịch vụ khuyến mại.<br />\r\n<br />\r\n<br />\r\nCông ty CP Cùng Mua và Đối tác cùng thảo luận thống nhất toàn bộ nội dung<br />\r\ncủa Deal, trên cơ sở các thông tin do Đối tác cung cấp bao gồm nhưng không<br />\r\ngiới hạn: giá bán, giá giảm, hình ảnh, mô tả sản phẩm/dịch vụ,…. Sau khi Công<br />\r\nty CP Cùng Mua kiểm duyệt các nội dung này theo đúng quy định của pháp luật<br />\r\nvề quảng cáo và khuyến mại thì sẽ đăng tải Deal trên Website TMĐT Cùng Mua<br />\r\nđể giới thiệu đến các Thành viên.cứu để đảm bảo chất lượng.<br />\r\n•<br />\r\n<br />\r\nQuy trình mua hàng:<br />\r\n<br />\r\nBước 1: Thành viên đăng nhập vào tài khoản đã đăng ký và chọn khu vực cung<br />\r\ncấp sản phẩm/dịch vụ (Hồ Chí Minh/Hà Nội/ Đà Nẵng/Cần Thơ/Khánh<br />\r\nHòa/Bình Dương/Đồng Nai/Bà Rịa – Vũng Tàu/Tỉnh Thành khác).<br />\r\nBước 2: Thành viên chọn banner để biết đầy đủ thông tin chương trình khuyến<br />\r\nmại của sản phẩm/dịch vụ đang quan tâm.<br />\r\nBước 3: Thành viên đã chọn số lượng và “Mua Ngay” để rà soát các thông tin<br />\r\ncủa đơn hàng đã chọn, bao gồm tên sản phẩm/dịch vụ, số lượng, chủng loại, đơn<br />\r\ngiá, thành tiền...thì kết thúc quy trình đặt hàng.<br />\r\n•<br />\r\n<br />\r\nCách thức thanh toán nhanh, đơn giản:<br />\r\n<br />\r\n<br />\r\n+ Cùng Mua nhận thanh toán bằng thẻ ATM hoặc thẻ tín dụng (VISA, MASTER<br />\r\nCARD) thông qua cổng thanh toán 123pay, chuyển khoản và tiền mặt.<br />\r\n+ Với thanh toán tiền mặt, Cùng Mua sẽ thu tiền khi giao hàng cho bạn.<br />\r\n+ Với thanh toán thẻ ATM nội địa qua cổng 123pay, khách hàng cần đăng ký<br />\r\ndịch vụ thanh toán qua Internet tại ngân hàng trước.<br />\r\n+ Với thanh toán chuyển khoản, bạn ghi rõ [Mã đơn hàng] hoặc [Số điện thoại<br />\r\nđặt hàng] trong Nội dung thanh toán để Cùng Mua kiểm tra khi nhận được tiền.<br />\r\nVà khách hàng còn được tham gia vào các chương trình khuyến mại lớn: Mua<br />\r\nhàng nhận tiền thưởng.<br />\r\n• Dịch vụ khách hàng:<br />\r\nCùng Mua giao hàng miễn phí đối với Phiếu Cùng Mua và những sản phẩm nhỏ<br />\r\ngọn, dễ chuyên chở. Với những sản phẩm nặng và cồng kềnh, Cùng Mua sẽ tính<br />\r\nphụ phí giao hàng để hỗ trợ tài chính cho nhân viên giao nhận. Phụ phí giao<br />\r\nhàng sẽ được Cùng Mua tính toán<br />\r\nĐối với đơn hàng từ 500.000 đồng trở lên, bạn sẽ được miễn phí chuyển phát<br />\r\nhàng. Các đơn hàng dưới 500.000 đồng, khoản phí giao hàng là 25.000 đồng/<br />\r\nđơn hàng.<br />\r\nĐể đảm bảo sự hài lòng tuyệt đối của khách hàng khi mua sắm tại<br />\r\ncungmua.com, Cùng Mua sẵn sàng nhận đổi trả sản phẩm hoặc phiếu và hoàn<br />\r\ntiền trong vòng 7 ngày kể từ khi khách hàng nhận sản phẩm hoặc đến khi hết<br />\r\nhạn sử dụng Phiếu. Cùng Mua sẽ hoàn tiền vào tài khoản của khách hàng trên<br />\r\ncungmua.com. Riêng sản phẩm và phiếu mua trực tiếp tại các cửa hàng của<br />\r\nCùng Mua sẽ không được đổi trả nếu không phải do lỗi của Cùng Mua hoặc đối<br />\r\ntác. Bạn vui lòng kiểm tra kỹ sản phẩm và phiếu khi mua trực tiếp tại các cửa<br />\r\nhàng Cùng Mua.<br />\r\nVà khi nhận hàng, khách hàng không thỏa mãn về sản phẩm có thể đổi hàng<br />\r\nhoặc trả hàng hoàn tiền.<br />\r\nQuy trình xác nhận/hủy đơn hàng:<br />\r\nTrong vòng 24h kể từ khi Thành viên hoàn tất việc đặt đơn hàng, Ban Quản Lý<br />\r\nWebsite TMĐT Cùng Mua sẽ tiến hành xác nhận đơn hàng và chuyển Bộ phận<br />\r\ngiao nhận tiến hành giao đơn hàng mà Thành viên đã đặt.<br />\r\n<br />\r\n<br />\r\nSau khi hoàn tất việc đặt đơn hàng trong vòng 24h, Thành viên có thể hủy đơn<br />\r\nhàng bằng cách chọn “Quản Lý Đơn Hàng” để “Hủy” đơn hàng đã đặt. Nếu<br />\r\nThành viên muốn hủy đơn hàng tại thời điểm nhận được phiếu/sản phẩm thì<br />\r\nphải thực hiện theo Chính sách đổi trả phiếu/sản phẩm.<br />\r\n• Điều kiện đổi trả :<br />\r\n+<br />\r\nSản phẩm chỉ được đổi trả trong vòng 7 ngày kể từ ngày khách hàng nhận<br />\r\nđược sản phẩm.<br />\r\n+<br />\r\nSản phẩm phải còn nguyên bao bì, nguyên tem, còn đầy đủ các chi tiết,<br />\r\nphiếu đi kèm và chưa qua sử dụng.<br />\r\n+<br />\r\n<br />\r\nSản phẩm không nằm trong danh mục sản phẩm miễn đổi trả.<br />\r\n<br />\r\n+<br />\r\n<br />\r\nPhiếu phải còn hạn sử dụng.<br />\r\n<br />\r\n+<br />\r\nTrong trường hợp có quy định đổi trả khác áp dụng riêng cho từng sản<br />\r\nphẩm hoặc phiếu, Cùng Mua sẽ ghi rõ trong phần “Lưu ý khi mua.”<br />\r\nVà khách hàng còn được tham gia vào các chương trình khuyến mại lớn: Mua<br />\r\nhàng nhận tiền thưởng.<br />\r\n+<br />\r\n<br />\r\nMua 3 sản phẩm khác nhau, nhận 5.000đ vào tài khoản thưởng<br />\r\n<br />\r\n+<br />\r\n<br />\r\nMua 6 sản phẩm khác nhau, nhận 10.000đ vào tài khoản thưởng.<br />\r\n<br />\r\n+<br />\r\nTiền thưởng sẽ được tặng vào tài khoản sau 3 ngày làm việc kể từ ngày<br />\r\nkhách hàng nhận đủ hàng hóa.<br />\r\n2.Mô hình doanh thu<br />\r\nVới mục tiêu giá trị như trên vậy mô hình doanh thu của cungmua.com là gì?<br />\r\nHay họ kiếm tiền bằng cách nào?<br />\r\nMô hình doanh thu chủ yếu của cungmua.com là phí giao dịch. Cùng Mua hoạt<br />\r\nđộng theo mô hình mua hàng theo nhóm. Khách hàng sẽ lựa chọn sản phẩm vào<br />\r\ngiỏ hàng hóa của mình, khi có đủ lượng khách hàng cùng mua sản phẩm hay<br />\r\ndịch vụ đó thì nhà cung cấp sẽ thông qua trang web trung gian là cùng mua để<br />\r\nbán sản phẩm cho khách hàng. Cùng Mua sẽ thu tiền chiết khấu của các doanh<br />\r\nnghiệp đó.<br />\r\nNgoài mô hình doanh thu phí giao dịch là chủ yếu thì Cùng Mua còn kiếm tiền<br />\r\nthông qua việc giới thiệu sản phẩm của các doanh nghiệp đến với khách hàng.<br />\r\n<br />\r\n<br />\r\nMột hình thức kiếm tiền khác của cùng mua đó là phí vận chuyển hàng hóa. Với<br />\r\nnhững mặt hàng gọn nhẹ Cùng Mua sẽ miễn phí vận chuyển hàng nhưng với<br />\r\nnhững mặt hàng công kềnh Cùng Mua sẽ tính phí giao hàng và sẽ báo cho khách<br />\r\nhàng biết ngay khi khách hàng đăng kí mua hàng.<br />\r\n3.Cơ hội thị trường của cungmua.com<br />\r\nVới sự phát triển của khoa học công nghệ, ứng dụng của internet trong cuộc<br />\r\nsống ngày càng được đẩy mạnh thêm vào đó là nhu cầu ngày càng cao của con<br />\r\nngười là cơ hội thị trường rất lớn cho Cùng Mua. Cùng mua chọn thành phố Hồ<br />\r\nChí Minh và Hà Nội là môi trường kinh doanh chủ yếu của mình bởi ở đây hệ<br />\r\nthống giao dịch trực tuyến phát triển, công nghệ thông tin phát triển rất mạnh<br />\r\ncộng với tâm lý người tiêu dùng rất phù hợp cho sự phát triển của Cùng Mua.<br />\r\nNgoài ra Hà Nội, Đà Nẵng và một số thành phố lớn khác cũng là thị trường<br />\r\nđược Cùng Mua chú trọng phát triển. Hiện tại Cùng Mua đang chuẩn bị mở rồng<br />\r\nkinh doanh ra các tỉnh và thành phố khác trong cả nước để đáp ứng kịp thời<br />\r\nnhu cầu của con người.<br />\r\n4.Chiến lược thị trường.<br />\r\nTrong quá trình hoạt động kinh doanh của mình mục tiêu mà cungmua.com<br />\r\nhướng tới là sẽ trở thành thương hiệu tin cậy trong thị trường thương mại điện<br />\r\ntử là cầu nối giữa người bán và người mua, giữa doanh nghiệp với doanh<br />\r\nnghiệp và là nơi cung ứng các sản phẩm chính hãng với giá rẻ. Đặc biệt với<br />\r\ncungmua.com, người tiêu dung có thể mua được các sản phẩm chất lượng với<br />\r\ngiá hấp dẫn nhờ chính sách nhiều người cùng mua hàng. Ông Hồ Quang Khánh<br />\r\nngười đại diện cho cungmua.com từng nói: “Hãy xem chúng tôi là một kênh tiếp<br />\r\nthị, quảng cáo sản phẩm đến người tiêu dùng, đừng coi chúng tôi là kênh bán<br />\r\nhàng.” Theo phân tích của ông thì mô hình kinh doanh này sẽ giúp doanh nghiệp<br />\r\ntận dụng chỗ trống trong thời gian rảnh rỗi hoặc thanh lý hàng tồn kho.<br />\r\nĐể thực hiện được mục tiêu đã đặt ra thì cungmua.com đã xác định chiến lược<br />\r\nthị trường là chiến lược ngách. Thị trường ngách sẽ giúp doanh nghiệp tiết<br />\r\nkiệm rất nhiều chi phí truyền thông quảng bá sản phẩm trong khi có thể gia<br />\r\ntăng khả năng thành công với mức độ rủi ro không cao. Thị trường ngách là<br />\r\nmột nhóm khách hàng có nhu cầu về một sản phẩm hoặc dịch vụ khá tương<br />\r\nđồng nhau. Thị trường ngách thật ra là một phần nhỏ trong tổng thị trường<br />\r\nrộng lớn, với thị trường ngách thì doanh nghiệp dễ dàng xác định đối tượng<br />\r\nkhách hàng mục tiêu hơn cũng như khả năng tiếp cận họ.<br />\r\n<br />\r\n<br />\r\nĐối với chiến lược như vậy thì cungmua.com đã đưa ra các sản phẩm, dịch vụ và<br />\r\ncác chính sách nhằm thu hút khách hàng là:<br />\r\n-<br />\r\n<br />\r\n-<br />\r\n<br />\r\n-<br />\r\n<br />\r\n-<br />\r\n<br />\r\n-<br />\r\n<br />\r\n-<br />\r\n<br />\r\n-<br />\r\n<br />\r\nCác sản phẩm có thương hiệu được thừa nhận rộng rãi. Với các sản phẩm<br />\r\ncó thương hiệu mạnh thì sẽ dễ dàng bán qua mạng hơn và độ tin cậy cao<br />\r\nhơn là một sản phẩm không có nhãn mác.<br />\r\nCùng Mua còn lựa chọn những hàng hóa được bảo hành bởi những người<br />\r\nbán hàng được tin cậy cao hoặc nổi tiếng.<br />\r\nCùng Mua còn tập trung khai thác và phát triển đa dạng các sản phẩm từ<br />\r\năn uống,du lịch, khách sạn, chăm sóc sức khỏe,...Với thế mạnh là quan hệ<br />\r\nkhách hàng thân thiết cùng với chính sách chăm sóc khách hàng độc đáo.<br />\r\nCùng Mua để được hưởng ưu đãi lớn: Ý tưởng của loại hình này là hứa<br />\r\nhẹn với đối tác, cam kết mang cho họ một lượng lớn người dùng xác định,<br />\r\nnhờ đó các chương trình khuyến mãi tốt nhất. Do sản phẩm không qua<br />\r\ntrung gian nên giá sẽ rẻ hơn và nhiều người Cùng Mua sẽ nhận được<br />\r\nkhuyến mãi lớn hơn. Thường thì giảm từ 50% đến 90% so với giá gốc.<br />\r\nChính điều này tạo ra mối liên hệ khăng khít giữa những nhà bán lẻ “thật”<br />\r\nvà những người tiêu dùng “ảo”. Một hướng đi mới, một dịch vụ kết hợp<br />\r\ngiữa truyền thống cộng đồng hay mạng xã hội và marketing. Mô hình kinh<br />\r\ndoanh đang làm biến đổi cách bán hàng của công ty nhất là những công<br />\r\nty nhỏ có ngân sách dành cho marketing hạn chế.<br />\r\nCùng Mua còn thu hút khách hàng với dịch vụ giao hàng miễn phí đói với<br />\r\nphiếu cùng mua và những sản phẩm nhỏ gọn, dễ chuyên chở. Đối với<br />\r\nnhững sản phẩm nặng và công kềnh cungmua sẽ tính thụ phí giao hàng<br />\r\nđể hỗ trợ tài chính cho nhân viên giao nhận.<br />\r\nCùng Mua còn cam kết sẵn sàng nhận đổi trả sản phẩm hoặc phiếu và<br />\r\nhoàn tiền trong vòng 7 ngày kể từ khi khách hàng nhận sản phẩm hoặc<br />\r\nđến khi hết hạn sử dụng Phiếu. Cùng Mua sẽ hoàn tiền vào tài khoản của<br />\r\nkhách hàng trên cungmua.com. Riêng sản phẩm và phiếu mua trực tiếp<br />\r\ntại các cửa hàng của Cùng Mua sẽ không được đổi trả nếu không phải do<br />\r\nlỗi của Cùng Mua hoặc đối tác.<br />\r\nCùng với các chính sách trên Cùng Mua còn đưa ra chương trình mua<br />\r\nhàng nhận tiền thưởng, mua càng nhiều nhận càng nhiều tiền thưởng.<br />\r\nMua 3 sản phẩm khác nhau sẽ nhận được 5.000 đồng vào tài khoản<br />\r\nthưởng. Điều này sẽ thu hút khách hàng mua nhiều sản phẩm hơn để tích<br />\r\nlũy được nhiều tiền thưởng.<br />\r\nCác thành viên tham gia mua sắm trực tuyến có những cơ hội giảm giá<br />\r\nlớn cho các sản phẩm dịch vụ. Một hình thức chèo kéo khách hàng quen<br />\r\nthuộc nhưng đi kèm với một điều kiện hoàn toàn mới mẻ: Bạn chỉ có thể<br />\r\n<br />\r\n<br />\r\nmua được hàng giảm giá nếu có một lượng khách hàng cùng mua loại<br />\r\nhàng đó vào cùng một thời điểm nhất định.<br />\r\n5.Môi trường cạnh tranh.<br />\r\nMôi trường cạnh tranh là một trong những yếu tố then chốt để một doanh<br />\r\nnghiệp có thể có được những thông tin nhằm đánh giá thị trường, hiểu được đối<br />\r\nthủ, từ đó định hướng để phát triển công ty.<br />\r\nCùng Mua đang hoạt động theo mô hình groupon và theo thống kê hiện nay trên<br />\r\nthị trường Việt Nam đang có khoảng gần 100 website hoạt động theo mô hình<br />\r\nnày, đơn cử có thể kể tới một số website lớn như:<br />\r\nnhommua.com : là công ty thành viên của MJ Group kinh doanh theo mô<br />\r\nhình \"Mua theo nhóm\" được đầu tư bởi 3 quỹ đầu tư Runet - Rebate Networks IDG. Nhóm Mua mang đến những sản phẩm/dịch vụ chất lượng cho cộng đồng<br />\r\nvới mức ưu đãi cực hấp dẫn, giảm đến 90% so với giá thị trường.<br />\r\nmuachungvn : được thành lập ngày 21/9/2010, là một thành viên của<br />\r\ncông ty cổ phần truyền thông Việt Nam ( VC Corp ).<br />\r\nHotdeal.vn : là một sản phẩm trực thuộc Mekong Com và được đầu tư bởi<br />\r\nquỹ đầu tư IDG Ventures, là website cung cấp các phiếu giảm giá nhà hàng, ăn<br />\r\nuống, spa làm đẹp, du lịch và các sản phẩm thời trang, gia dụng.<br />\r\nRõ ràng cungmua.com đã và đang đứng trước thách thức vô cùng lớn.<br />\r\nVề phạm vi hoạt động, dù mang tiếng là thương mại điện tử, có thể giao dịch ở<br />\r\nmọi nơi, nhưng phần lớn các giao dịch (deal) vẫn chật hẹp, chủ yếu tập trung ở<br />\r\ncác thành phố lớn là Hà Nội và thành phố Hồ Chí Minh vì ở hai thành phố này hệ<br />\r\nthống giao dịch trực tuyến mới phát triển. Còn tại các thành phố khác, các công<br />\r\nty phải tổ chức đội vận chuyển hàng hóa tới tay người tiêu dùng làm tăng thêm<br />\r\nchi phí. Tuy nhiên vẫn có một số website vẫn tích cực mở rộng mạng lưới bán<br />\r\nhàng của mình tiêu biểu như muachung.vn với các văn phòng tại Hà Nội, Tp. Hồ<br />\r\nChí Minh, Đà Nẵng, Nha Trang, Hải Phòng, Vũng Tàu.<br />\r\nTiếp đó là về thị phần và doanh thu: theo một thống kê được thực hiện bởi<br />\r\nwebsite dealcuatui.com năm 2011 đối với 15 web bán hàng phổ biến nhất ở Việt<br />\r\nNam thì nhommua.com, hotdeal.vn, cungmua.com và muachung.vn đang dẫn<br />\r\nđầu thị trường.<br />\r\n<br />\r\n<br />\r\nCụ thể, theo thống kê nói trên, xét về doanh số, trang nhommua.com đang chiếm<br />\r\n35,89% thị phần với 225,586 tỷ đồng. Đứng thứ hai là hotdeal.vn với 167,068 tỷ<br />\r\nđồng, chiếm 26,58% thị phần. Tiếp đến là trang muachung.vn với 91,213 tỷ<br />\r\nđồng, chiếm 14,51% thị phần. Và đứng thứ tư là cungmua.com với 85,617 tỷ<br />\r\nđồng, chiếm 13,63% thị phần.<br />\r\nVề số tiền tiết kiệm, nhommua.com dẫn đầu với 475,035 tỷ đồng, chiếm 37,26%<br />\r\ntrên tổng số hơn 1.274 tỷ đồng tiền tiết kiệm của toàn bộ 15 trang web mua<br />\r\ntheo nhóm trong danh sách của dealcuatui.com. Tiếp theo là trang hotdeal.vn<br />\r\nvới 33,24%, cungmua.com với 12,43% và muachung.vn với 8,71%.<br />\r\nVề số vụ mua theo nhóm (deal) đã thực hiện, thống kê cho thấy, tổng số deal của<br />\r\n15 trang hàng đầu là 6.722 vụ. Trong đó, xếp đầu bảng là nhommua.com với<br />\r\n1.551 deal, chiếm 23,07%. Đứng kế tiếp là hotdeal.vn với 1.062 deal, chiếm<br />\r\n15,8%; cungmua.com với 978 deal, chiếm 14,55%; muachung.vn với 944 deal,<br />\r\nchiếm 14,04%.<br />\r\nCuối cùng về số phiếu giảm giá (voucher) các web đã bán được, nhommua.com<br />\r\nvẫn dẫn đầu với 1.643.121 voucher, chiếm 38,34% trên tổng số hơn 4,28 triệu<br />\r\nvoucher của toàn bộ 15 trang web trong khảo sát. Kế tiếp là hotdeal.vn với 1,071<br />\r\ntriệu phiếu, cungmua.com với hơn 554 nghìn phiếu và muachung.vn với trên<br />\r\n488 nghìn phiếu.<br />\r\nHiện nay, cùng với sự cạnh tranh khốc liệt của quá nhiều doanh nghiệp với “<br />\r\nchiếc bánh lợi nhuận “ của mô hình groupon đã khiến cho rất nhiều những<br />\r\ndoanh nghiệp nhỏ phải từ bỏ hoặc phát sinh vẫn đề trong điều hành<br />\r\nTừ đó chúng ta có thể thấy được sự cạnh tranh khốc liệt như vậy của thị trường<br />\r\nmua hàng theo nhóm. Tuy nhiên theo Báo cáo Thương mại điện tử Việt Nam của<br />\r\nHiệp hội Thương mại điện tử Việt Nam năm 2012 thì mức độ tăng trưởng của 5<br />\r\nsàn giao dịch TMĐT hàng đầu mô hình mua theo nhóm xét trên 4 tiêu chí: lượng<br />\r\nthành viên, lượng giao dịch thành công, tổng giá trị giao dịch thành công, tổng<br />\r\ndoanh thu đều mức tăng trưởng rất cao, về doanh thu cá biệt lên tới 82%.<br />\r\nNhư vậy, có thể thấy được cungmua.com đang đứng trước sự cạnh tranh rất lớn<br />\r\ntừ rất nhiều đối thủ, tuy nhiên với những hướng đi đúng đắn, những cách làm<br />\r\nmới cùng sự đi lên của thương mại điện tử tại Việt Nam thì cơ hội phát triển cho<br />\r\ncungmua.com vẫn là rất lớn.<br />\r\n6.Lợi thế cạnh tranh.<br />\r\n<br />\r\n<br />\r\nCùng Mua hoạt động trên cơ sở mua hàng theo số đông, trực tiếp từ nhà cung<br />\r\ncấp mà không phải thông qua nhiều cấp trung gian. Hơn nữa, Cùng Mua còn là<br />\r\nkênh truyền thông và quảng cáo cho sản phẩm, dịch vụ của nhà cung cấp. Chính<br />\r\nvì vậy, Cùng Mua có khả năng lấy được giá tốt nhất để phục vụ các bạn. Đây<br />\r\nchính là một lợi thế cạnh tranh lớn của Cùng Mua. Cùng với các chương trình<br />\r\nkhuyến mãi lớn nhưng vẫn đảm bảo chất lượng sản phẩm cùng mua đang ngày<br />\r\ncàng thu hút khách hàng.<br />\r\nNgoài ra với hình thức giao hàng tận nơi và nếu không hài lòng với sản phẩm<br />\r\nkhách hàng có thể trả lại hàng và nhận lại hoàn toàn theo đúng lời cam kết của<br />\r\ncông ty. Qua đó càng nâng cao được uy tín của công ty.<br />\r\n7.Sự phát triển của tổ chức<br />\r\nHệ thống tổ chức của Cùng Mua luôn đảm bảo sự hài hòa gắn kết chặt chẽ các<br />\r\nbộ phận cùng thực hiện hiệu quả. Hệ thống tổ chức được tổ chức theo cấu trúc<br />\r\nchức năng đứng đầu là giám đốc, tiếp theo là các trưởng phòng bộ phận chịu sự<br />\r\nchỉ đạo trực tiếp của giám đốc.<br />\r\nVới cách thu hút nguồn nhân lực chất lượng cao và sắp xếp thành một tổ chức<br />\r\nhoàn chỉnh bằng các chính sách đãi ngộ hấp dẫn hoặc mạnh dạn thay đổi cơ<br />\r\ncấu để trở thành môi trường thu hút người có tâm, có tài từ đó tạo ra một bộ<br />\r\nmáy tổ chức hoàn hảo đã góp phần giúp Cùng Mua thực hiện hiệu quả các kế<br />\r\nhoạch và chiến lược kinh doanh.<br />\r\n8.Đội ngũ quản trị<br />\r\nVai trò đội ngũ quản trị trong quản lý hoạt động kinh doanh và tổ chức thực<br />\r\nhiện kế hoạnh và mô hình kinh doanh rất quan trọng, kỹ năng và trình độ của<br />\r\nnhà quản trị là một trong những lợi thế cạnh tranh chủ yếu, đây là yếu tố cần<br />\r\nthiết đối với mô hình kinh doanh mới, xác định được tầm quan trọng của đội<br />\r\nngũ quản trị , Cùng Mua đã đào tạo và có một hệ thống quản trị tài giỏi ,tư duy<br />\r\ncao.<br />\r\nĐứng đầu trong đội ngũ quản trị là giám đốc đại diện pháp luật ông Trần Đăng<br />\r\nKhoa cùng với đội ngũ quản trị trẻ, năng động và đầy nhiệt huyết như trưởng<br />\r\nphòng hành chính nhân sự bà Nguyễn Huỳnh Thảo Vy, hay trưởng nhóm kỹ<br />\r\nthuật ông Lê Đức Trang cùng trưởng bộ phận điều phối bà Nguyễn Thị Minh<br />\r\nHoàng. Cùng Mua đang ngày càng xây dựng một đội ngũ quản trị vững mạnh<br />\r\nđưa công ty ngày một phát triển.<br />\r\n<br />\r\n<br />\r\nTeam Cùng Mua gồm những bạn trẻ năng động, sáng tạo và đầy nhiệt huyết. Họ<br />\r\nđến từ nhiều lĩnh vực, ngành nghề nhưng đều có chung mục tiêu xây dựng một<br />\r\ntổ chức vững mạnh, mang lại lợi ích lớn nhất cho khách hàng và đối tác.<br />\r\nVới sự hiện diện tại nhiều thành phố trên lãnh thổ Việt Nam, Cùng Mua luôn tự<br />\r\nhào trong việc phát triển con người trên cả hai phương diện cá nhân và chuyên<br />\r\nmôn, cũng như tạo nên các vị trí làm việc hấp dẫn, đa dạng, nơi mà bạn có cơ<br />\r\nhội đóng góp và tạo nên sự khác biệt. Nếu bạn muốn thành công, nếu bạn đánh<br />\r\ngiá cao một môi trường học hỏi năng động và muốn được thể hiện trách nhiệm<br />\r\nthật sự, bạn hãy cùng xây dựng sự nghiệp của mình với Cùng Mua. Cùng Mua<br />\r\nluôn cam kết sẽ cung cấp cho nhân viên của mình một sự trợ giúp hoàn thiện<br />\r\nnhất với chế độ đãi ngộ và mức thu nhập cạnh tranh, môi trường làm việc<br />\r\nchuyên nghiệp, đảm bảo các quyền lợi theo đúng quy định của luật lao động.<br />\r\nTham vọng của Cùng Mua trong việc trở thành nhà tuyển dụng hàng đầu trong<br />\r\nmô hình Groupon được thể hiện qua các đề nghị hấp dẫn công ty đưa ra. Cùng<br />\r\nMua thường xuyên xem xét lại các hoạt động của mình so với thị trường bên<br />\r\nngoài, nhờ vậy mà Cùng Mua luôn luôn có thể thu hút và giữ được những người<br />\r\ngiỏi nhất., thăng tiến được xét trên thành tích công việc. Cùng Mua luôn khuyến<br />\r\nkhích nhân viên chủ động trong việc định hướng nghề nghiệp của mình và sẵn<br />\r\nsàng cung cấp những phương tiện học tập và phát triển nhằm nâng cao tính<br />\r\nsáng tạo ở mỗi cá nhân.<br />\r\nCùng Mua đặc biệt chú trọng đầu tư vào một đội ngũ nhân lực hiệu quả bởi con<br />\r\nngười là yếu tố quan trọng nhất để đạt đến thành công. Do đó bên cạnh các điều<br />\r\nkhoản đã được ký kết trong Hợp đồng lao động, Công ty luôn chú trọng việc xây<br />\r\ndựng và phát triển chính sách lao động nhằm mục đích đảm bảo nhiều quyền lợi<br />\r\nkhác cho nhân viên, nâng cao hiệu quả công tác, đời sống tinh thần của nhân<br />\r\nviên khi làm việc tại Cùng Mua.<br />\r\n3.9.Cơ hội thị trường và thách thức đối với cungmua.com<br />\r\nCơ hội thị trường:<br />\r\nThương mại điện tử là 1 xu thế mới, đang phát triển ở VN<br />\r\nHình thức thương mại điện tử không còn là mới mẻ đối với người Việt Nam tuy<br />\r\nnhiên thương mại điện tử ở nước ta vẫn còn non trẻ, những doanh nghiệp lớn<br />\r\nkinh doanh điện tử như “cungmua.com” là không nhiều. Hiện nay, do công việc<br />\r\nbận rộn, thời gian ít nên người tiêu dùng, đặc biệt là giới trẻ sử dụng phương<br />\r\npháp mua online khá nhiều. Do đó đây là 1 thị trường rộng lớn, không nhiều các<br />\r\n<br />\r\n<br />\r\nđối thủ cạnh tranh mạnh nên có thể là miếng bánh béo bở cho các doanh nghiệp<br />\r\nnhư Cùng Mua.<br />\r\n- Giá rẻ + thị trường lớn<br />\r\nNgười mua sắm trên mạng chủ yếu là phụ nữ, nhất là phụ nữ trẻ mà đối với tập<br />\r\nkhách hàng này, giá cả và sự thuận tiện là 1 yếu tố thu hút được rất nhiều sự<br />\r\nchú ý. Do đó với mức giá rẻ, có thể nói rất rẻ như ở “cungmua.com” thì việc các<br />\r\nkhách hàng là nữ, dù biết chất lượng không cao nhưng do giá rẻ, mẫu mã đẹp<br />\r\nnên vẫn mua. Đây là một thị trường rộng mở và tiềm năng.<br />\r\n- Đối tượng văn phòng ngày càng bận rộn và thích mua sắm online để tiết kiệm<br />\r\nthời gian: nền kinh tế thị trường cuốn con người vào guồng quay bận rộn công<br />\r\nviệc và chăm sóc gia đình nhiều khi chiếm gần hết thời gian của họ nên họ bắt<br />\r\nđầu thích mua sắm qua mạng hơn<br />\r\n-Các ngân hàng mở rộng mạng lưới thẻ ATM và Credit:giúp cho khách hàng có<br />\r\nthể thanh toán qua thẻ một cách thuận tiện hơn<br />\r\nThách thức:<br />\r\n- Theo khảo sát thị trường về xu hướng người sử dụng internet tại Việt Nam<br />\r\n(Net Index 2011) do Yahoo! và hãng nghiên cứu thị trường Kantar Media công<br />\r\nbố, tỷ lệ truy cập tại gia đình năm 2011 đạt 88%. Nhưng tại Việt Nam, người<br />\r\ndân vẫn chưa mấy mặn mà với hoạt động mua hàng qua mạng. Qua kết quả<br />\r\nkhảo sát của Net Index 2011, chỉ có 18% người trả lời khảo sát cho biết đã có<br />\r\nthực hiện giao dịch trực tuyến trong 12 tháng qua, có 61% người trả lời rằng<br />\r\nkhông có ý định mua hàng trên mạng trong 12 tháng tới, 39% cho rằng “có thể<br />\r\nsẽ mua”. 93% cho biết họ thanh toán bằng tiền mặt trực tiếp khi mua hàng trên<br />\r\nmạng, chỉ có 18% trả qua tài khoản ATM, 11% có trả qua thẻ tín dụng và chỉ có<br />\r\n2% sử dụng dịch vụ ngân hàng điện tử (internet banking). Điều này cho thấy<br />\r\nlượng người sẵn sàng sử dụng dịch vụ mua hàng trực tuyến vẫn chưa cao. Đây<br />\r\nlà một trong những thách thức không nhỏ đối với muachung.vn để có thể thu<br />\r\nhút ngày càng nhiều khách hàng sử dụng dịch vụ mua hàng trực tuyến.<br />\r\n- Hiện nay, không ít vụ mua bán lừa đảo diễn ra trên mạng, điển hình như vụ<br />\r\nMB24, đã khiến người tiêu dùng mất lòng tin vào các trang mua bán trực tuyến.<br />\r\nViệc này ảnh hưởng rất nhiều đến lòng tin và sự sẵn sàng mua sản phẩm của<br />\r\nkhách hàng đối với cungmua.com<br />\r\n<br />\r\n<br />\r\n- Tuy thị trường mua sản phẩm theo nhóm, mua các deal giảm giá trên mạng<br />\r\ntrực tuyến còn khá mới mẻ nhưng muachung.vn đã gặp phải không ít đối thủ<br />\r\ncạnh tranh. Có thể kể đến như: nhommua.com, hotdeal.vn, muachung.vn,<br />\r\ndeal.zing.vn, muare.vn,... Điều này đòi hỏi cungmua.com phải luôn hoàn thiện<br />\r\nmình để thu hút khách hàng, chiếm lấy thị phần lớn.<br />\r\n- Do làm việc với rất nhiều nhà sản xuất và các mặt hàng khác nhau,<br />\r\ncungmua.com gặp không ít khó khăn trong việc kiểm tra chất lượng cũng như<br />\r\nuy tín của các sản phẩm và nhà sản xuất. Nếu khâu quản lý kiểm tra không được<br />\r\nthuận lợi, cungmua.com dễ bị trở thành nơi bán hàng tồn, hàng kém chất lượng<br />\r\ncủa các nhà sản xuất không trung thực, từ đó dẫn đến giảm uy tín của công ty.<br />\r\n- Đối với các voucher mặt hàng dịch vụ như ăn uống, spa, khách sạn,...<br />\r\ncungmua.com gặp rất nhiều khó khăn trong việc kiểm soát khả năng và thái độ<br />\r\ncung ứng dịch vụ của nhà cung cấp. Nếu nhà cung cấp không phục vụ khách<br />\r\nhàng với chất lượng dịch vụ tốt như đăng ký, thái độ phục vụ thiếu chuyên<br />\r\nnghiệp, có những hành vi phân biệt đối xử với khách dùng voucher của công ty,...<br />\r\nthì uy tín của Cùng Mua cũng sẽ bị ảnh hưởng nặng nề.<br />\r\n- Do lượng khách hàng với mỗi deal là rất lớn nên việc hỗ trợ dịch vụ sau mua<br />\r\ncủa Cùng Mua còn gặp không ít khó khăn, nhiều khi còn chậm trễ<br />\r\n- Để đảm bảo hoạt động của cungmua.com đạt hiệu quả cao, một đội ngũ nhân<br />\r\nviên giỏi chuyên môn, giàu kinh nghiệm là rất cần thiết. Tuy vậy, Thương mại<br />\r\nđiện tử vẫn còn là một ngành mới mẻ đối với Việt Nam. Vì thế, nguồn nhân lực<br />\r\nvề ngành này vẫn còn thiếu và yếu. Chính vì vậy mà hoạt động của đội ngũ nhân<br />\r\nviên cungmua.com vẫn còn nhiều thiếu sót.<br />\r\n- Pháp lí chưa đủ mạnh: để xử lí những vụ lừa đảo trên mạng do một nhóm<br />\r\nngười gây ra khi sử dụng hình thức kinh doanh thương mại điện tử, dẫn đến<br />\r\nkhách hàng mất long tin và hay nghi ngờ hình thức kinh doanh này<br />\r\n-Việc đơn hàng bị giao chậm có thể mất hình ảnh của Cùng Mua<br />\r\nCác đơn hàng bị giao chậm thường do một số nguyên nhân như sau:<br />\r\n+ Nhân viên giao hàng không liên lạc được với Quý khách. Trường hợp này<br />\r\nCùng Mua sẽ liên lạc lại với khách để hẹn lại thời gian giao sản phẩm trong 1-2<br />\r\nngày. Sau đó, đơn hàng của quý khách sẽ được gửi trả về Văn phòng Cùng Mua<br />\r\n<br />\r\n<br />\r\n+ Có trục trặc về vấn đề hàng hóa (Hàng chưa về…) Cùng Mua sẽ có hình thức<br />\r\nthông báo cho Quý khách về tình trạng sản phẩm và sẽ tiến hàng giao sản phẩm<br />\r\ncho Quý khách trong thời gian sớm nhất có thể.<br />\r\n- Hiện nay, sự khắc nghiệt khi quá nhiều công ty tranh nhau \"chiếc bánh lợi<br />\r\nnhuận\" của mô hình Groupon đã làm cho những đơn vị yếu thế phải từ bỏ hoặc<br />\r\nphát sinh các vấn đề điều hành. Tháng 2/2012, website mua theo nhóm Zingdeal<br />\r\ncủa công ty cổ phần VNG quản lý đã ngừng hoạt động, sau hơn một năm thành<br />\r\nlập.<br />\r\nGần đây nhất là sự kiện công ty Nhóm Mua \"thay tướng\". Công ty phát đi thông<br />\r\ncáo cựu CEO Tom Trần đang bị cơ quan chức năng điều tra, và quyết định bổ<br />\r\nnhiệm ông Kyle Phạm vào vị trí Giám đốc điều hành công ty. Ngay sau đó,<br />\r\nwebsite của Nhóm Mua đã dừng hoạt động trong 4 ngày, khiến không ít khách<br />\r\nhàng đã mua phiếu giảm giá của hãng bị từ chối phục vụ tại một số địa chỉ do<br />\r\nNhóm Mua chưa thanh toán hóa đơn cho các đơn vị này.Điều này tác động<br />\r\nkhông nhỏ đến lòng tin của cả người bán lẫn người mua khi tham gia thương<br />\r\nmại điện tử. \"Từ đó tiếp tục dấy lên những lo ngại về hành lang pháp lý cần thiết<br />\r\nđể kiểm soát rủi ro phát sinh, nhằm đảm bảo quyền lợi các bên tham gia\".<br />\r\n<br />\r\n<br />\r\nCHƯƠNG IV: MỘT SỐ GIẢI PHÁP NHẰM NÂNG CAO<br />\r\nHIỆU QUẢ HOẠT ĐỘNG CỦA CUNGMUA.COM<br />\r\nTheo thống kê từ trang web dealcuatui.com, hiện nay tổng doanh thu trong<br />\r\nngành này đạt hơn 670 tỉ đồng, dẫn đầu là nhommua.com với tổng doanh thu<br />\r\nkhoảng 240 tỉ đồng, chiếm 36% thị phần, tiếp đó là hotdeal.vn khoảng 178 tỉ<br />\r\nđồng, chiếm khoảng 24% thị phần, muachung.vn khoảng 99 tỉ đồng, chiếm 15%<br />\r\nthị phần, còn cungmua.com đạt khoảng 90 tỉ đồng, chiếm 13% thị phần.<br />\r\nTheo Công ty Tư vấn McKinsey, mỗi người Việt trung bình chi khoảng 13<br />\r\nUSD/tháng, tức khoảng 260.000 đồng, để mua hàng trực tuyến. Với thị trường<br />\r\nhơn 80 triệu dân, doanh thu của thương mại điện tử sẽ không nhỏ. Tiềm năng<br />\r\nphát triển mua theo nhóm là có thật. Nhiệm vụ của các doanh nghiệp hiện tại<br />\r\nkhông còn chỉ là cạnh tranh về giá mà còn là đưa ra các giải pháp tập trung về<br />\r\ndài hạn và định hướng cho tương lai của công ty cho chất lượng dịch vụ, để khôi<br />\r\nphục niềm tin cho người tiêu dùng cũng như đối tác<br />\r\n1. Đối với nhà cung cấp<br />\r\nVề phía nhà cung cấp vẫn còn tồn tại vấn đề quản lý chất lượng dịch vụ của<br />\r\nngười bán chưa được thắt chặt, khiến người dùng quan tâm tới chất lượng<br />\r\nhàng hóa nhiều hơn trước. Trên các trang mạng có không ít lời tham phiền về<br />\r\nsản phẩm mua theo nhóm không như lời quảng cáo, một số người dùng còn tố<br />\r\nnhà cung cấp \"có thái độ phân biệt giữa khách thường và khách dùng voucher\"<br />\r\nThậm chí, có những công ty sẵn sàng \"hét\" giá sản phẩm hoặc dịch vụ lên cao<br />\r\nhơn thực tế, sau đó đặt tỷ lệ giảm giá lớn khiến người mua cho rằng mình được<br />\r\nlợi từ chương trình. Bên cạnh đó, các loại hàng giả, hàng nhái cũng \"đồng thau<br />\r\nlẫn lộn\" với hàng thật, một số website bán hàng cố tình mập mờ thông tin hoặc<br />\r\n<br />\r\n<br />\r\nghi sai để đánh lừa người tiêu dùng ngây thơ. Trước tình hình đó, doanh nghiệp<br />\r\nnên :<br />\r\n-Thỏa thuận và nêu rõ những vấn đề kể trên trước khi đi đến ký kết hợp đồng<br />\r\nvới các nhà cung cấp dịch vụ . Công ty nên không khuyến khích các nhà cung cấp<br />\r\ndịch vụ giảm giá quá nhiều, hơn 50% so với giá bán bình thường, mà không đi<br />\r\nkèm với việc bảo đảm chất lượng, bởi tâm lý của khách hàng cho thấy một dịch<br />\r\nvụ nếu giảm giá quá nhiều cũng làm cho họ nghi ngại về chất lượng.<br />\r\n-Trong trường hợp nhà cung cấp dịch vụ phục vụ khách hàng không đúng như<br />\r\nsự cam kết ban đầu và số trường hợp khách hàng than phiền chiếm từ 5% trở<br />\r\nlên thì công ty sẽ ngưng bán dịch vụ, cắt hợp đồng với nhà cung cấp. Thực hiện<br />\r\ncác chế tài bằng tiền, không trả lại tiền bán dịch vụ cho các nhà cung cấp nếu<br />\r\nnhư có nhiều khách hàng than phiền về thái độ phục vụ, chất lượng dịch vụ.<br />\r\n-Ngoài ra, một vấn đề thường xảy ra là một số các nhà cung cấp dịch vụ - sản<br />\r\nphẩm vì sợ kẹt vốn nên đã ký kết với nhiều trang web và chạy chương trình cách<br />\r\nnhau chỉ vài ngày hoặc vài tuần. Khi khách hàng cầm phiếu mua hàng đến đổi<br />\r\nlấy sản phẩm hay sử dụng dịch vụ, các nhà cung cấp không đủ hàng để giao cho<br />\r\nkhách, nhân viên không được huấn luyện chuyên nghiệp để giải quyết các<br />\r\ntrường hợp này nên dẫn đến việc khách hàng thấy họ bị xem thường, có cảm<br />\r\ngiác bị lừa đảo.Trong những trường hợp như vậy, vấn đề không phải là chi phí<br />\r\nthu hồi phiếu mua hàng, voucher và hoàn tiền cho khách mà là uy tín của các<br />\r\ntrang web bán hàng, của nhà cung cấp dịch vụ trong lòng người tiêu dùng bị sụt<br />\r\ngiảm nhiều. Chính vì vậy, công ty nên nói rõ điều khoản này, trước khi đi đến kí<br />\r\nkết hợp đồng với nhà cung cấp, yêu cầu nhà cung cấp kéo dài khoảng cách thời<br />\r\ngian giữa các chương trình khác nhau, và đưa ra chế tài về tiền nếu nhà cung<br />\r\ncấp không thực hiện đúng những dịch vụ cung cấp cho khách hàng như trong<br />\r\nhợp đồng đã kí kết.<br />\r\n2.Đối với khách hàng<br />\r\n-Công ty nên sát sao sử dụng hình thức người tiêu dùng sẽ được công ty hoàn<br />\r\ntiền nếu nhà cung cấp không thực hiện đúng cam kết trên lượng hàng mà họ đã<br />\r\nbán. Ngoài ra,công ty có thể áp dụng hình thức khách mua hàng mà chưa có nhu<br />\r\ncầu sử dụng trong khoảng một tháng thì có thể bán lại cho trang web này với<br />\r\ngiá khoảng 70% giá mua ban đầu. Và sẽ tiếp tục bán những voucher đó tại các<br />\r\nshowroom của công ty.<br />\r\n<br />\r\n<br />\r\n-Để giữ chân khách hàng trung thành, công ty có thể triển khai chương trình<br />\r\ntặng thẻ thành viên cho những khách hàng trung thành của trang web này. Ví<br />\r\ndụ như ở cungmua.com, khách hàng sẽ sử dụng được ngay các dịch vụ có trên<br />\r\ntrang cungmua.com mà không cần thanh toán trước cũng như chờ đợi thời gian<br />\r\ngiao phiếu.<br />\r\nKhi tiêu dùng dịch vụ - sản phẩm, khách hàng sẽ được giảm giá khoảng 50%,<br />\r\nphần còn lại sẽ trả cho nhà cung cấp dịch vụ bằng tiền mặt. Bên cạnh đó, những<br />\r\nkhách hàng khác, để sở hữu thẻ thành viên này, phải mua với giá khoảng<br />\r\n480.000 đồng. Công ty cũng có thể áp dụng hình thức này, và có thể cho thêm<br />\r\nnhững điều khoản ưu đãi hơn, điều này sẽ giúp hạn chế sự phân biệt đối xử giữa<br />\r\nkhách hàng sử dụng phiếu giảm giá với khách hàng trả bằng tiền mặt tại các<br />\r\nquán ăn, nhà hàng, địa điểm giải trí… có hợp tác với công ty.<br />\r\n-Nếu trường hợp công ty tạm ngừng hoạt động do xảy ra lỗi hệ thống..v..v..<br />\r\nnhưng đang tạm giữ nhiều tiền của người mua đã thanh toán, cũng chưa trả<br />\r\ntiền cho doanh nghiệp cung cấp sản phẩm sẽ gây ảnh hưởng đến cả hai bên mua<br />\r\nvà bán\". Thêm vào đó, nhờ tính năng hoàn trả thanh toán khi có sự cố, các đơn<br />\r\nvị giao dịch trung gian sẽ giúp người tiêu dùng an toàn hơn trước và tin tưởng<br />\r\ncông ty hơn. Tuy nhiên, tỷ lệ thanh toán bằng tiền mặt qua việc nhân viên Cùng<br />\r\nMua đến tận nơi để thanh toán vẫn còn khá lớn, chính vì vậy, công ty nên đưa ra<br />\r\nnhững chính sách ưu đãi tốt hơn đối với những khách hàng chấp nhận thanh<br />\r\ntoán trực tuyến. Ví dụ như, được tăng điểm thưởng, hoặc tặng tặng tiền vào ví<br />\r\nđiện tử của khách hàng. Đến khi mức điểm thưởng ở một mức độ, khách hàng sẽ<br />\r\nđược nhận một phần quà nào đó từ phía công ty. Điều này, không những giữ<br />\r\nchân được khách hàng, giúp khách hàng trung thành hơn với doanh nghiệp mà<br />\r\ncòn giúp công ty có thể giảm được chi phí hơn so với việc đến tận nơi thu tiền<br />\r\ncủa khách hàng.<br />\r\n3. Đối với bản thân doanh nghiệp<br />\r\n-Nhanh chóng triển khai xây dựng các showrom nhằm hỗ trợ khách hàng có nơi<br />\r\nđể kiểm chứng sản phẩm trước khi mua dùng trong thực tế do hiện tại mới chỉ<br />\r\ncó trụ sở đặt tại thành phố Hồ Chí Minh và Hà Nội.<br />\r\n-Doanh nghiệp không những phải nắm vững về việc kinh doanh trên nền tảng<br />\r\nthương mại điện tử, công nghệ, mà còn phải biết đầu tư, tìm hiểu nắm bắt tâm<br />\r\nlý, thói quen của người tiêu dùng để đưa ra các deal hấp dẫn, phù hợp hơn.<br />\r\n<br />\r\n<br />\r\n-Đưa người đến kiểm tra sản phẩm, dịch vụ của nhà cung cấp, cần phải thực<br />\r\nhiện vô cùng sát sao bước này, vì đây là bước quản trọng, khách hàng có hài<br />\r\nlòng về công ty hay không thì bước này chính là nền tảng để thực hiện điều đó.<br />\r\nĐồng thời nên tăng cường công tác thẩm định, kiểm duyệt deal trước và sau khi<br />\r\nbán.<br />\r\n-Doanh nghiệp cũng cần có sự đầu tư lớn và dài hạn để tạo được sự khác biệt,<br />\r\nđịnh vị hình ảnh thương hiệu nhằm tạo ra uy tín bằng chất lượng sản phẩm và<br />\r\ndịch vụ cung cấp, thông qua đó xây dựng niềm tin thương hiệu lâu dài đối với<br />\r\nngười tiêu dùng cũng như thu hút được nhiều deal hấp dẫn hơn từ phía nhà<br />\r\ncung cấp.<br />\r\n-Bên cạnh đó, trong một đến hai năm tới, công ty có thể bán phiếu giảm giá<br />\r\nthông qua ứng dụng di động chạy trên điện thoại thông minh (smartphone).<br />\r\nHiện tại mới chỉ có Công ty Giải pháp di động VHT đang thử nghiệm mô hình<br />\r\nnày. Và theo dự báo của các công ty nghiên cứu thị trường, khi lượng người sử<br />\r\ndụng điện thoại thông minh tăng trưởng mạnh, hình thức bán phiếu giảm giá<br />\r\nthông qua ứng dụng di động có thể phát triển theo.<br />\r\n-Để đảm bảo được chất lượng dịch vụ tốt nhất cho khách hàng, các nhà cung<br />\r\ncấp dịch vụ - sản phẩm sẽ được chuyển tiền ngay vào tài khoản khi khách hàng<br />\r\nsử dụng deal, hoàn toàn chủ động về tần suất chạy deal, số lượng deal…<br />\r\n-Đôi khi người tiêu dùng không đọc kỹ điều kiện deal khi sử dụng dịch vụ hay<br />\r\nsản phẩm, hơn nữa lại khá nhạy cảm khi gặp phải sự cố, dù đôi khi nguyên nhân<br />\r\nlà từ việc không hiểu rõ điều kiện deal. Chính vì vậy, công ty nên huấn luyện các<br />\r\nnhân viên để khi giao hàng hoặc giao deal cho khách, một lần nữa cần giải thích<br />\r\nrõ ràng các điều kiện trong deal với khách hàng.<br />\r\n-Kết hợp cùng với kênh truyền hình để giới thiệu và thực hiện dịch vụ các<br />\r\ndeal,nhằm tiếp cận hơn với khách hàng.<br />\r\n<br />\r\n<br />\r\nKẾT LUẬN<br />\r\nVới những chiến lược thị trường, dịch vụ chăm sóc khách hàng tận tụy cùng đội<br />\r\nngủ quản trị giỏi, và phong cách làm việc chuyên nghiệp đã tạo cho Cùng Mua<br />\r\nmột chỗ đứng ngày càng vững chắc trong thời đại kinh tế hiện nay. Điều đó giúp<br />\r\nmở ra cơ hội lớn cho để Cùng Mua có thể phát triển và mở rộng thị trường. Luôn<br />\r\nđi kèm với cơ hội là những khó khan thách thức, hiện nay trên thị trường Việt<br />\r\nNam cũng có không ít những kênh bán hàng trực tuyến với phần tram chiếm<br />\r\nlĩnh thị trường lớn như nhommuna.com, runhau.com…. Điều này đòi hỏi cùng<br />\r\nmua phải có một mô hình kinh doanh toàn diện hơn để có thể đưa công ty phát<br />\r\ntriển trong thời kì cạnh tranh gay gắt như hiện nay.<br />\r\n<br />\r\n<br />\r\n </div>\r\n', '<p>Giới thiệu</p>\r\n', 'Giới thiệu', '<p>Giới thiệu</p>\r\n', '<p>Giới thiệu</p>\r\n', 'CÔNG TY TNHH ANH ĐỨC NGUYỄN', 'CÔNG TY TNHH ANH ĐỨC NGUYỄN, gỗ sấy tại biên hòa, go say tai bien hoa, go say bien hoa, gỗ sấy biên hòa', 'CÔNG TY TNHH ANH ĐỨC NGUYỄN, CÔNG TY TNHH ANH ĐỨC NGUYỄN, gỗ sấy tại biên hòa, go say tai bien hoa, go say bien hoa, gỗ sấy biên hòa', '14ffd96837b1004-2340.jpg', '14ffd96837b1004-2340_300x300.jpg', 'bggioithieu-6142.png', 0, 0, 1444361037, 1515416231, '', '', '');
