(9, '', 'trangchu', 'Dich vụ của công ty chúng tôi', 'dich-vu-cua-cong-ty-chung-toi', '', '<p> CÔNG TY TNHH TƯ VẤN THIÊT KẾ XÂY DỰNG PHÚC HUY được thành lập vào đầu năm 2008.Từ khi thành lập đến nay, Công ty chúng tôi đã thực hiện trên 100 công trình dân dụng, công nghiệp trên khắp cả nước và đã tạo được sự tin cậy của các chủ đầu tư. Điều đó đã làm nên uy tín của CÔNG TY TNHH TƯ VẤN THIÊT KẾ XÂY DỰNG PHÚC HUY hôm nay.<br />\r\nVới phương châm: Đề cao chất lượng, giá cả hợp lý, sẵn sàng hợp tác với tất cả các đối tác.... nguyên tắc bình đẳng cùng có lợi.        </p>\r\n', '', '', '', '0', '0', '0', '', '', '', 'gioithieu-1936.png', 'gioithieu-1936_590x260.png', '', 0, 0, 1453187783, 1457758887, '', '', ''),
(10, '', 'dichvu_t', 'MỌI THỨ TỐT CHO KHÁCH HÀNG', 'moi-thu-tot-cho-khach-hang', '', '<p style=\"text-align: center;\">Phan Nguyễn tự hào là nơi được lựa chọn để chuyển tải yêu thương và lưu giữ những khoảnh khắc ngọt ngào, thăng hoa của những đôi tim yêu đã tìm thấy nhau. Giữa những khung ảnh, cảm xúc như được lắng đọng.</p>\r\n', '', '', '', '0', '0', '0', '', '', '', '', '', '', 1, 0, 1453258098, 0, '', '', ''),
(11, '', 'aocuoi', '', '', '', '<p style=\"text-align: center;\">Hiện nay, thay vì tìm đến các dịch vụ <a href=\"http://www.aocuoigiasi.com\">cho thuê áo cưới</a>, các cô dâu thường có xu hướng đặt may 1 bộ áo</p>\r\n\r\n<p style=\"text-align: center;\">cưới cho riêng mình. Như vậy vừa đáp ứng được sở thích của mình, vừa có thể giữ lại vật kỷ niệm cho</p>\r\n\r\n<p style=\"text-align: center;\">ngày trọng đại nhất của đời mình. Nhưng để tìm được một dịch vụ may áo cưới đẹp ở TPHCM phù hợp</p>\r\n\r\n<p style=\"text-align: center;\">với nhu cầu của mình là một việc không hề đơn giản. Các bạn thường gặp khó khăn trong việc tìm các</p>\r\n\r\n<p style=\"text-align: center;\">cửa hàng may áo cưới đẹp với giá thành hợp lý bởi vì các cửa hàng lớn đều có giá may áo cưới khá cao.</p>\r\n\r\n<p style=\"text-align: center;\">Áo Cưới Hồng Anh sẽ giải quyết những nỗi lo lắng đó giúp bạn. Với nhiều năm kinh nghiệm trong ngành,</p>\r\n\r\n<p style=\"text-align: center;\">chúng tôi tự tin sẽ mang đến cho bạn những bộ áo cưới mới đẹp nhất với giá thành hợp lý nhất.</p>\r\n\r\n<p style=\"text-align: center;\">Những lý do mà bạn nên chọn <a href=\"http://www.aocuoigiasi.com\">Áo cưới</a> Hồng Anh của chúng tôi :</p>\r\n\r\n<p style=\"text-align: center;\">- Là một trong những trung tâm mua bán, nhận đặt may áo cưới, veston lớn nhất tại TPHCM.</p>\r\n\r\n<p style=\"text-align: center;\">- Chuyên cung cấp áo cưới đẹp cho các studio áo cưới tại các tỉnh thành trên cả nước.</p>\r\n\r\n<p style=\"text-align: center;\">- Tọa lạc tại vị trí đắc địa nhất tại trung tâm mua bán áo cưới ở Sài Gòn, không gian sang trọng,</p>\r\n\r\n<p style=\"text-align: center;\">hiện đại</p>\r\n\r\n<p style=\"text-align: center;\">- Có xưởng may riêng, vì vậy giá thành luôn rẻ nhất</p>\r\n\r\n<p style=\"text-align: center;\">- Luôn cập nhập các mẫu mã hiện đại và thời trang nhất trên thế giới</p>\r\n\r\n<p style=\"text-align: center;\">- Cung cấp dịch vụ may áo cưới theo catalog mới nhất, đáp ứng được mọi nhu cầu của cô dâu</p>\r\n\r\n<p style=\"text-align: center;\">- Đặc biệt, chúng tôi còn nhận thiết kế và may áo cưới theo yêu cầu của các studio, nhận xuất</p>\r\n\r\n<p style=\"text-align: center;\">khẩu áo cưới nhiều nước trên thế giới</p>\r\n\r\n<p style=\"text-align: center;\">- Thiết kế áo cưới theo yêu cầu cô dâu , giá cả hợp lý nhất .</p>\r\n\r\n<p style=\"text-align: center;\">Nếu bạn đang có dự định mở một studio hoặc cửa hàng áo cưới và đang cần tìm địa chỉ may áo cưới</p>\r\n\r\n<p style=\"text-align: center;\">đẹp giá sỉ ở TPHCM thì hãy ngay lập tức liên lạc với chúng tôi để nhận được sự hỗ trợ và tư vấn sớm</p>\r\n\r\n<p style=\"text-align: center;\">nhất nhé. Áo cưới Hồng Anh tin chắc sẽ là trở thành một đối tác uy tín của bạn.</p>\r\n\r\n<p style=\"text-align: center;\">Với những ưu điểm trên, chúng tôi tin chắc sẽ là một trong những địa chỉ may áo cưới đẹp tại TPHCM</p>\r\n\r\n<p style=\"text-align: center;\">mà bạn đang tìm kiếm. Hãy lựa chọn áo cưới Hồng Anh và để chúng tôi làm bạn hài lòng.</p>\r\n\r\n<p style=\"text-align: center;\">Thông tin liên lạc :</p>\r\n\r\n<p style=\"text-align: center;\">Xưởng may áo cưới Hồng Anh</p>\r\n\r\n<p style=\"text-align: center;\">Nhận may áo cưới giá rẻ theo cataluge nước ngoài 2014 . Thời gian hoàn thành  sản phẩm nhanh, đảm bảo đúng theo số đo .</p>\r\n\r\n<p style=\"text-align: center;\">Những mẫu áo cưới mới nhất theo cataluge 2014 : <a href=\"http://aocuoigiasi.com/may-ao-cuoi-scpo\">http://aocuoigiasi.com/may-ao-cuoi-scpo</a></p>\r\n\r\n<p style=\"text-align: center;\">Cam kết giá cạnh tranh nhất tại Sài Gòn .</p>\r\n\r\n<p style=\"text-align: center;\">- Địa chỉ: 444 Lý Thường Kiệt , P.7 , Q.TB ( đối diện chợ Tân Bình )</p>\r\n\r\n<p style=\"text-align: center;\">- Điện thoại : 0906.762.766 - 08.35030175 (Ms.Thảo)</p>\r\n\r\n<p style=\"text-align: center;\"> </p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://aocuoigiasi.com/multidata/imagephp-259.jpg\" style=\"width: 418px; height: 532px;\" /></p>\r\n', '', '', '', '0', '0', '0', '', '', '', 'mauvaycuoimuathu2012-5-7289.jpg', 'mauvaycuoimuathu2012-5-7289_375x495.jpg', '', 0, 0, 1453272792, 1453434893, '', '', ''),
(12, '', 'hinhanh', 'LƯU LẠI TỪNG KHOẢNH KHẮC', 'luu-lai-tung-khoanh-khac', '', '<p style=\"text-align: center;\">Hình cưới là những hành trình tìm kiếm cảm xúc thăng hoa của Tình yêu. Và chúng tôi là người có nhiệm vụ lưu lại những cảm xúc ấy một cách chân thực nhất. Các bạn có Tình Yêu, chúng tôi có đam mê, tất cả sẽ làm nên những điều kỳ diệu.</p>\r\n', '', '', '', '0', '0', '0', '', '', '', '', '', '', 1, 0, 1453280925, 0, '', '', ''),
(13, '', 'chamsoc', '', '', '', '<p dir=\"ltr\" id=\"docs-internal-guid-f2760a11-9fc3-99a9-9a35-8e04de6864d1\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;text-align: justify;\"><span style=\"font-size:20px;\"><span style=\"font-family: comic sans ms,cursive;\"><big><span style=\"color: rgb(255, 0, 0);\"><strong><span style=\"background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Cửa hàng đồ chơi E</span></strong></span></big></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;text-align: justify;\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;text-align: justify;\"><span style=\"font-size:16px;\"><span background-color:=\"\" color:=\"\" font-style:=\"\" font-variant:=\"\" font-weight:=\"\" new=\"\" text-decoration:=\"\" times=\"\" vertical-align:=\"\">Hotline: </span><span style=\"color: rgb(255, 0, 0);\"><span background-color:=\"\" font-style:=\"\" font-variant:=\"\" font-weight:=\"\" new=\"\" text-decoration:=\"\" times=\"\" vertical-align:=\"\">0909.525.595</span></span><span background-color:=\"\" color:=\"\" font-style:=\"\" font-variant:=\"\" font-weight:=\"\" new=\"\" text-decoration:=\"\" times=\"\" vertical-align:=\"\"> - Mr. Tuấn</span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span background-color:=\"\" color:=\"\" font-style:=\"\" font-variant:=\"\" font-weight:=\"\" new=\"\" text-decoration:=\"\" times=\"\" vertical-align:=\"\">Địa chỉ: 410/15B Cách Mạng Tháng 8</span></span></p>\r\n', '', '', '', '0', '0', '0', '', '', '', '', '', '', 0, 0, 1453965517, 1454379644, '', '', ''),
(15, '', 'linhvuchoatdong', 'Lĩnh vực hoạt động', 'linh-vuc-hoat-dong', '<h5 class=\"heading\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; font-weight: bold; position: relative; font-size: 3.5rem; text-transform: uppercase; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">THIẾT KẾ VÀ IN ẤN</h5>\r\n\r\n<div class=\"excerpt\" style=\"box-sizing: border-box; margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; font-size: 15px; max-width: 745px;  font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 22.5px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; background: transparent;\">Thiết kế, in ấn các sản phẩm cho quảng cáo, ấn phẩm văn phòng, tạp chí, catalogue, profile, tờ rơi, tờ gấp, tem – nhãn, hóa đơn, phong bì thư, name card…</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 1.5rem 0px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; background: transparent;\">Các sản phẩm bao bì, thùng carton, túi đựng, hộp điện thoại, lịch tết, thiếp mời …</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 1.5rem 0px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; background: transparent;\">Sản xuất, mua, bán bao bì, giấy và các sản phẩm từ giấy. Kinh doanh vật tư, thiết bị phục vụ ngành quảng cáo…</p>\r\n</div>\r\n', '', '', '', '', '', '', '', '', '', '', 'ghome3-3260.png', 'ghome3-3260_470x410.png', '', 1, 1, 1473739352, 0, '', '', '');
