(16, '', 'gioithieu2', '', '', '', '<p style=\"line-height:normal;\"><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:12.0pt;\">Bạn đang tìm một công việc có </span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:15.0pt;\">cơ hội thăng tiến</span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:12.0pt;\">, phát triển cao với </span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:16.0pt;\">thu nhập hấp dẫn?</span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:12.0pt;\"> Được đào tạo và </span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:17.0pt;\">đi du lịch miễn phí</span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:12.0pt;\"> ?</span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;line-height:150%;\"><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:12.0pt;\">Chúng tôi là KNST Corp, Công ty chuyên </span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:15.0pt;\">huấn luyện các kỹ năng sinh tồn</span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:12.0pt;\"> và </span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:15.0pt;\">đi Phượt </span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:12.0pt;\">cho giới trẻ, hiện nay đang có các vị trí dành cho bạn như sau:</span></span></strong></p>\r\n\r\n<ol>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">NHÂN VIÊN CHĂM SÓC KHÁCH HÀNG    số lượng:  20 bạn nam/ nữ.</span></span></strong></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Chat, chăm sóc khách hàng trên hotline và web.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Tư vấn các khóa học cho học viên.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Chăm sóc facebook của từng khóa học.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Hỗ trợ huấn luyện viên trong công tác huấn luyện.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Phát triển hệ thống khách hàng, đại lý.</span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;line-height:150%;\"><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Yêu cầu năng lực:</span></span></strong></p>\r\n\r\n<ul>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Ngoại hình ưa nhìn.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Sử dụng tốt vi tính văn phòng.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Từng có kinh nghiệm ở vị trí tương đương.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Sử dụng tốt các phần mềm truyền thông mạng xã hội (email, facebook, zalo….).</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Tiếng anh giao tiếp tốt.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Đam mê du lịch.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Chấp nhận đi công tác và du lịch.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Ưu tiên biết kỹ năng cắm trại.</span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;line-height:150%;\"><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Quyền lợi:</span></span></str