triệu đến 40 triệu/tháng</strong>.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Hưởng các chính sách theo đúng quy định của nhà nước và Luật Lao Động.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Được đào tạo, đi du lịch miễn phí.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Được làm việc trong môi trường năng động, trẻ trung, đầy nhiệt huyết.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Cơ hội thăng tiến, phát triển cao.</span></span></li>\r\n</ul>\r\n\r\n<ol>\r\n	<li style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\" value=\"4\"><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">NHÂN VIÊN THIẾT KẾ VÀ MEDIA              số lượng:  2 bạn nam/ nữ.</span></span></strong></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Quay phim và dựng phim cho các buổi huấn luyện.</span></span></li>\r\n	<li style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Làm các kỹ xảo và dựng video quảng cáo.</span><