(84, 9, 11, 0, 0, 0, 0, 0, '', 0, 'product', 1, 1, '14567926801280486323198764047986310335138495518268n-6816.jpg', '14567926801280486323198764047986310335138495518268n-6816_290x290.jpg', 'Sản phẩm 2', 'sp2', 0, 'san-pham-2', '', '', '', '', '', '', '', '', 'Sản phẩm 2', 'Sản phẩm 2', 'Sản phẩm 2', 0, 0, 0, 0, 'With well-sized, clean and functional bungalows, Thai Tan Tien is simply a hide-away relaxation in a true natural spot on Phu Quoc island. Most of the bungalows are with sea view.', '<p>Sản phẩm 2</p>\r\n', '', '', '', '', '', '', '', '', 0, '', '', 1, 1, 1470228957, 1497318457, 39, 0, '', '', ''),
(85, 9, 11, 0, 0, 0, 0, 0, '', 0, 'product', 1, 1, 'a05b376fcc6f23317a7e-3263.jpg', 'a05b376fcc6f23317a7e-3263_190x200.jpg', 'Sản phẩm 1', 'sp1', 0, 'san-pham-1', '', '', '', '', '', '', '', '', 'Sản phẩm 1', 'Sản phẩm 1', 'Sản phẩm 1', 0, 0, 1000000, 0, 'With well-sized, clean and functional bungalows, Thai Tan Tien is simply a hide-away relaxation in a true natural spot on Phu Quoc island. Most of the bungalows are with sea view.', '<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Các cầu thủ <strong>MU</strong> chưa kịp hoàn toàn nhập cuộc vào trận đấu thì họ đã bị thủng lưới chỉ sau hơn 1 phút nhờ vào một khoảnh khắc lóe sáng cá nhân. Tận dụng một quả tạt vào của đồng đội, Moussa Sow tung một cú \"ngả bàn đèn\" đẹp mắt đánh bại De Gea để Fenerbahce dẫn 1-0.</p>\r\n\r\n<p style=\"font-family:Arial, Helvetica, sans-serif; line-height:1.4; color:rgb(0, 0, 0); text-align:center\"><img alt=\"Fenerbahce - MU: Choáng váng bởi siêu phẩm vô-lê - 1\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/4-2016/images/2016-11-04/1478199792-1478196696831_lc_galleryimage_epa05616229_fenerbahce_is-500.jpg\" style=\"border: 0px; max-width: 400px; width: 500px; height: 267px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Moussa Sow ghi tuyệt phẩm để Fenerbahce sớm dẫn trước</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Tình thế trở nên khó khăn hơn cho <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/manchester-united-c48e1521.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"MU\">MU</a> khi tiền vệ ngôi sao Paul Pogba phải rời sân sau nửa giờ thi đấu do chấn thương. Tung vào sân Zlatan Ibrahimovic, Jose Mourinho vẫn không thay đổi được sự tích cực trong thế trận của đội khách, cơ hội nguy hiểm đáng kể nhất của họ ở hiệp 1 là cho Marcus Rashford ở phút 34.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Sang hiệp 2, thế trận bế tắc của <em>MU</em> tiếp tục diễn ra bất chấp Jose Mourinho tiếp tục dùng quyền thay người khi tung Juan Mata và sau đó là Henrikh Mkhitaryan vào sân. Phút 59, Jeremain Lens có một quả đá phạt đẹp mắt trong khi David De Gea đứng yên, giúp Fenerbahce dẫn 2-0. Chủ nhà thậm chí có thể đã dẫn 3-0 nếu như dự bị Emenike không bỏ lỡ 2 cơ hội ngon ăn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Hy vọng bất chợt lóe lên cho MU ở phút 89 khi Wayne Rooney tung cú sút xa trái phá để rút ngắn 1-2. MU tràn lên trong 4 phút bù giờ và ở phút 90+3, tranh cãi nổ ra khi Ander Herrera có cú sút chạm tay Martin Skrtel trong vòng cấm, nhưng trọng tài từ chối quả penalty cho MU. Tỷ số 2-1 được Fenerbahce bảo toàn thành công tới hết trận.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Tỷ số trận đấu</strong>: <u>Fenerbahce 2 - 1 MU</u> (hiệp 1: 1-0)</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Ghi bàn:</strong> </p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">- Fenerbahce: Sow 2\', Lens 59\'</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">- MU: Rooney 89\'</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Đội hình xuất phát:</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Fenerbahce: Demirel; Ozbayrakli, Kjaer, Skrtel, Kaldirim; Lens, Potuk, Topal, Souza, Sen; Sow</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">MU: De Gea, Darmian, Blind, Rojo, Shaw, Schneiderlin, Herrera, Rashford, Pogba, Martial, Rooney.</p>\r\n', '', '', 'en', 'en', '<p>en</p>\r\n', 'cn', 'cn', '<p>cn</p>\r\n', 0, '', '', 1, 1, 1470228982, 1515341761, 111, 0, '', '', '');
